define('text!modules/home/home.html', ['module'], function(module) { module.exports = "<template>\r\n    <section class=\"au-animate\">\r\n        <div class='row topMargin leftMargin'>\r\n            <div class=\"col-lg-2 bigTopMargin\">\r\n                <h2 class=\"underline\">UCC Information</h2>\r\n                 <div class=\"${item.priority}\" repeat.for=\"item of siteinfo.siteArray | infoFilter:'SYST'\">\r\n                    <h3>${item.title}</h3>\r\n                    <span innerhtml=\"${item.content}\"></span>\r\n                    <hr/>\r\n                </div>\r\n                <div repeat.for=\"item of siteinfo.siteArray | infoFilter:'INFO'\">\r\n                    <h3>${item.title}</h3>\r\n                    <span innerhtml=\"${item.content}\"></span>\r\n                    <hr/>\r\n                </div>\r\n                <div class=\"bigTopMargin\">\r\n                    <h2 class=\"underline\">Sessions</h2>\r\n                    <div class=\"list-group\">\r\n                        <a class=\"list-group-item\" repeat.for=\"session of sessions.sessionsArray\">\r\n                            <h4 class=\"list-group-item-heading\">${session.sessionStatus}: Session ${session.session} - ${session.year}</h4>\r\n                            <p class=\"list-group-item-text\">Requests open: ${session.requestsOpenDate | dateFormat:config.DATE_FORMAT_TABLE}</p>\r\n                            <p class=\"list-group-item-text\">Clients available: ${session.startDate | dateFormat:config.DATE_FORMAT_TABLE}</p>\r\n                            <p class=\"list-group-item-text\">Session ends: ${session.endDate | dateFormat:config.DATE_FORMAT_TABLE}</p>\r\n                        </a>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n               \r\n            \r\n            <div class=\"container bigTopMargin col-lg-10\">\r\n                <div class=\"col-md-8\">\r\n                    <compose view=\"./components/homeContent.html\"></compose>\r\n                   \r\n                    <div class=\"col-md-12 bigTopMargin\">\r\n                        <h3 class=\"underline bottomMargin\">Useful Links</h3>\r\n                        <div repeat.for=\"item of siteinfo.siteArray | infoFilter:'OLNK'\">\r\n                            <compose view=\"./components/homePageLinks.html\"></compose>\r\n                        </div>\r\n                    </div>\r\n                \r\n                </div>\r\n\r\n                <div class=\"col-md-4\">\r\n                    <h2 class=\"underline\">UCC and UA News</h2>\r\n                    <div repeat.for=\"item of siteinfo.siteArray | infoFilter:'NEWS'\">\r\n                    <compose view=\"./components/newsItem.html\"></compose>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </section>\r\n</template>"; });
