define('text!modules/analytics/components/requestsTable.html', ['module'], function(module) { module.exports = "<template>\r\n    <div class=\"col-lg-10 col-lg-offset-1\">\r\n        <div class='row'>\r\n            <table id=\"peopleTable\" class=\"table table-striped table-hover\">\r\n                <thead>\r\n                    <tr>\r\n                        <td colspan='${numCols}'>\r\n                            <compose view=\"../../../resources/elements/table-navigation-bar.html\"></compose>\r\n                        </td>\r\n                    </tr>\r\n                    <tr>\r\n                        <th>Institution  <span click.trigger=\"dataTable.sortArray('institutionId', 'id', people.institutionsArray, '_id', 'name')\"><i class=\"fa fa-sort\"></i></span></th>\r\n                        <th>${config.REQUEST_STATUS[0].description} <span click.trigger=\"dataTable.sortArray('1')\"><i class=\"fa fa-sort\"></i></span></th>\r\n                        <th>${config.REQUEST_STATUS[1].description} <span click.trigger=\"dataTable.sortArray('2')\"><i class=\"fa fa-sort\"></i></span></th>\r\n                        <th>${config.REQUEST_STATUS[2].description} <span click.trigger=\"dataTable.sortArray('3')\"><i class=\"fa fa-sort\"></i></span></th>\r\n                        <th>${config.REQUEST_STATUS[3].description} <span click.trigger=\"dataTable.sortArray('4')\"><i class=\"fa fa-sort\"></i></span></th>\r\n                        <th>${config.REQUEST_STATUS[4].description} <span click.trigger=\"dataTable.sortArray('5')\"><i class=\"fa fa-sort\"></i></span></th>\r\n                        <th>${config.REQUEST_STATUS[5].description} <span click.trigger=\"dataTable.sortArray('6')\"><i class=\"fa fa-sort\"></i></span></th>\r\n                    </tr>\r\n                </thead>\r\n                <tbody>\r\n                    <tr repeat.for=\"stat of displayArray | pageFilter:dataTable.startRecord:dataTable.take\">\r\n                        <td>${stat.institutionId  | lookupValue:people.institutionsArray:'_id':'name'}</td>\r\n                        <td repeat.for=\"status of config.REQUEST_STATUS\">${stat | statValue:config.REQUEST_STATUS:$index}</td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n        </div>\r\n    </div>\r\n    </div>\r\n</template>"; });
define('text!modules/facco/components/peopleForm.html', ['module'], function(module) { module.exports = "<template>\r\n    <div class=\"col-lg-12\">\r\n            <div class=\"bottomMargin list-group-item leftMargin rightMargin\">\r\n                <span click.delegate=\"back()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Back\"><i class=\"fa fa-arrow-left fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n                <span click.delegate=\"save()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Save\"><i class=\"fa fa-floppy-o fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n                <span click.delegate=\"cancel()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Cancel Changes\"><i class=\"fa fa-ban fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n            </div>  \r\n\r\n            <div class=\"topMargin\">\r\n                <form class=\"form-horizontal topMargin\">\r\n                     <!-- Row 1 -->\r\n                    <div class=\"row\">\r\n                        <div class=\"col-lg-1\">\r\n                            <div style=\"height:100px;width:100px;\" innerhtml.bind=\"people.selectedPerson.email | gravatarUrl:100:6\"></div>\r\n                        </div>\r\n                        <div class=\"col-lg-10 col-lg-offset-1\">\r\n                            <div class=\"row topMargin\">\r\n                                <div class=\"col-lg-6\">\r\n                                    <h3 innerhtml.bind=\"Name\"></h3>\r\n                                </div>\r\n                            \r\n                                <div class=\"col-lg-6\">\r\n                                    <div class=\"form-group pull-left\">\r\n                                        <label class=\"control-label col-sm-3 hideOnPhone\">Status</label>\r\n                                        <div class=\"col-sm-8\">\r\n                                            <select value.bind=\"people.selectedPerson.personStatus\" id=\"editStatus\" class=\"form-control input-md\" placeholder=\"Status\">\r\n                                                <option value=\"\">Select an option</option>\r\n                                                <option repeat.for='status of is4ua.personStatusArray' value=\"${status.code}\">${status.description}</option>\r\n                                            </select>\r\n                                        </div>\r\n                                    </div>\r\n                                </div>\r\n                            </div>\r\n                            \r\n                            <div class=\"row topMargin\">\r\n                                <div class=\"col-lg-6\">\r\n                                    <div class=\"col-sm-12 col-lg-12\">\r\n                                        <h3>Contact</h3> \r\n                                    </div>\r\n                                    <div class=\"col-sm-12 col-lg-12\">\r\n                                        <h4>Phone: <span innerhtml.bind=\"people.selectedPerson.phone\"></span></h4> \r\n                                    </div>\r\n                                    <div class=\"col-sm-12 col-lg-12\">\r\n                                        <h4>Mobile: <span innerhtml.bind=\"people.selectedPerson.mobile\"></span></h4> \r\n                                    </div>\r\n                                    <div class=\"col-sm-12 col-lg-12\">\r\n                                        <h4>Email: <span innerhtml.bind=\"people.selectedPerson.email\"></span></h4> \r\n                                    </div>\r\n                                </div>\r\n                                 <div class=\"col-lg-6\">\r\n                                     <div class=\"col-sm-12 col-lg-12\">\r\n                                        <h3>Address</h3> \r\n                                    </div>\r\n                                    <div class=\"col-sm-12 col-lg-12\">\r\n                                        <h4><span innerhtml.bind=\"people.selectedPerson.address1\"></span><h4>\r\n                                        <h4 if.bind=\"people.selectedPerson.address2\"><span innerhtml.bind=\"people.selectedPerson.address2\"></span><h4>\r\n                                        <h4><span innerhtml.bind=\"people.selectedPerson.city\"></span> <span innerhtml.bind=\"people.selectedPerson.region\">, <span innerhtml.bind=\"people.selectedPerson.postalCode\"></span></span><h4>\r\n                                        <h4><span innerhtml.bind=\"people.selectedPerson.country\"></span><h4>\r\n                                    </div>\r\n                                </div>\r\n                            </div>\r\n                            <div class=\"row topMargin\">\r\n                                <div class=\"col-lg-6\">\r\n                                    <div class=\"col-sm-12 col-lg-12\">\r\n                                        <h3>Area</h3> \r\n                                    </div>\r\n                                    <div class=\"col-sm-12 col-lg-12\">\r\n                                        <h4>Specialization: <span innerhtml.bind=\"people.selectedPerson.personSpecialization\"></span></h4> \r\n                                    </div>\r\n                                    <div class=\"col-sm-12 col-lg-12\">\r\n                                        <h4>Department: <span innerhtml.bind=\"people.selectedPerson.departmentCategory\"></span></h4> \r\n                                    </div>\r\n                                </div>\r\n                                 <div class=\"col-lg-6\">\r\n                                    <div class=\"col-sm-12 col-lg-12\">\r\n                                        <h3>Roles</h3> \r\n                                    </div>\r\n                                    <div class=\"col-sm-12 col-lg-12\">\r\n                                        <h4 innerhtml.bind=\"roles\"></h4> \r\n                                    </div>\r\n                                </div>\r\n                            </div>\r\n                            \r\n                            \r\n                            \r\n                          \r\n                            </div>\r\n                        </div>\r\n                    </div> <!-- Row -->\r\n                </form>\r\n            </div>\r\n    </div>\r\n</template>"; });
define('text!modules/facco/components/peopleTable.html', ['module'], function(module) { module.exports = "<template>\r\n    <div class=\"col-lg-12\">\r\n        <div class='row'>\r\n            <div class='col-lg-10 col-lg-offset-1 bottomMargin'>\r\n                <table id=\"peopleFacCoTable\" class=\"table table-striped table-hover\">\r\n                    <thead>\r\n                        <tr>\r\n                            <td colspan='6'>\r\n                                <compose view=\"../../../resources/elements/table-navigation-bar.html\"></compose>\r\n                            </td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td colspan='6'>\r\n                                <span click.delegate=\"refresh()\" class=\"smallMarginRight\"><i class=\"fa fa-refresh\" aria-hidden=\"true\"></i></span>\r\n                                <span class=\"pull-right\" id=\"spinner\" innerhtml.bind=\"spinnerHTML\"></span>\r\n                            </td>\r\n                        </tr>\r\n                        <tr>\r\n                            <th style=\"width:20rem;\">Name <span click.trigger=\"dataTable.sortArray('lastName')\"><i class=\"fa fa-sort\"></i></span></th>\r\n                            <th style=\"width:15rem;\">Phone</th>\r\n                            <th style=\"width:20rem;\">eMail <span click.trigger=\"dataTable.sortArray('email')\"><i class=\"fa fa-sort\"></i></span></th>\r\n                            <th>Role</th>\r\n                            <th>Status</th>\r\n                        </tr>\r\n                    </thead>\r\n                    <tbody>\r\n                        <tr>\r\n                            <th>\r\n                                <input input.delegate=\"dataTable.filterList($event)\" id=\"lastName\" type=\"text\" placeholder=\"Filter Name\" class=\"form-control\">\r\n                            </th>\r\n                            <th></th>\r\n                            <th></th>\r\n                            <th>\r\n                                <input input.delegate=\"dataTable.filterList($event)\" id=\"roles\" type=\"text\" placeholder=\"Filter Role\" class=\"form-control\" compare=\"array\">\r\n                            </th>\r\n                            <th>\r\n                                <select change.delegate=\"dataTable.filterList($event)\" class=\"form-control \" id=\"personStatus\">\r\n                                    <option value=\"\"></option>\r\n                                    <option repeat.for='status of is4ua.personStatusArray' value='${status.code}'>${status.description}</option>\r\n                                </select>\r\n                            </th>\r\n                        </tr>\r\n                        <tr  click.trigger=\"edit($index, $event)\" repeat.for=\"person of displayArray | pageFilter:dataTable.startRecord:dataTable.take\">\r\n                            <td data-title=\"name\">${person.firstName} ${person.lastName}</td>\r\n                            <td data-tile=\"phone\">${person.phone}</td>\r\n                            <td data-title=\"email\">${person.email}</td>\r\n                            <td data-title=\"role\">${person.roles}</td>\r\n                            <td data-title=\"status\">${person.personStatus | lookupDescription:is4ua.personStatusArray}</td>\r\n                        </tr>\r\n                    </tbody>\r\n                 </table>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</template>"; });
define('text!modules/facco/components/requestDetailDetails.html', ['module'], function(module) { module.exports = "<template>\r\n     <div class=\"col-lg-5\" show.bind=\"showRequest\">\r\n    <div class=\"panel panel-primary topMargin\">\r\n      <div class=\"panel-heading\">\r\n        <h3 class=\"panel-title\">${selectedProductID | productName:products.productsArray}</h3>\r\n      </div>\r\n      <div class=\"panel-body\">\r\n        <h5>Request status: ${requests.selectedRequestDetail.requestStatus | lookupDescription:config.REQUEST_STATUS}</h5>\r\n        <h5>Assigned system: ${requests.selectedRequestDetail.assignment.systemId | lookupSid:systems.systemsArray}</h5>\r\n        <h5>Assigned client: ${requests.selectedRequestDetail.assignment.clientId | lookupSid:systems.systemsArray}</h5>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</template>"; });
define('text!modules/facco/components/requestsTable.html', ['module'], function(module) { module.exports = "<template>\r\n  <div class=\"col-lg-10 col-lg-offset-1\">\r\n      <div class='row'>\r\n        <table id=\"peopleTable\" class=\"table table-striped table-hover\">\r\n            <thead>\r\n              <tr>\r\n                  <td colspan='8'>\r\n                      <compose view=\"../../../resources/elements/table-navigation-bar.html\"></compose>\r\n                  </td>\r\n              </tr>\r\n              <tr>\r\n                  <td colspan='7'>\r\n                      <span click.delegate=\"refresh()\" class=\"smallMarginRight\"><i class=\"fa fa-refresh\" aria-hidden=\"true\"></i></span>\r\n                      <span class=\"pull-right\" id=\"spinner\" innerhtml.bind=\"spinnerHTML\"></span>\r\n                  </td>\r\n              </tr>\r\n             <tr>\r\n               <th class=\"col-xs-1\">No <span click.trigger=\"dataTable.sortArray('requestNo')\"><i class=\"fa fa-sort\"></i></span></th>\r\n               <th class=\"col-lg-1\">Due <span click.trigger=\"dataTable.sortArray('sid')\"><i class=\"fa fa-sort\"></i></span></th>\r\n               <th class=\"col-lg-1\">Requested <span click.trigger=\"dataTable.sortArray('sid')\"><i class=\"fa fa-sort\"></i></span></th>\r\n               <th class=\"col-lg-1\">Type</th>\r\n               <th class=\"col-lg-1\">Status <span click.trigger=\"dataTable.sortArray('sid')\"><i class=\"fa fa-sort\"></i></span></th>\r\n               <th class=\"col-sm-1\">IDS Requestd</th>\r\n               <th class=\"col-lg-2\">Product <span click.trigger=\"dataTable.sortArray('sid')\"><i class=\"fa fa-sort\"></i></span></th>\r\n               <th class=\"col-lg-1\">Faculty <span click.trigger=\"dataTable.sortArray('sid')\"><i class=\"fa fa-sort\"></i></span></th>\r\n             </tr>\r\n           </thead>\r\n           <tbody>\r\n             <tr>\r\n               <th></th>\r\n               <th>\r\n                 <input change.delegate=\"dataTable.filterList($event)\" id=\"requiredDate\" type=\"date\" class=\"form-control datepicker\" data-dateformat=config.DATE_FORMAT_TABLE>\r\n               </th>\r\n               <th>\r\n                 <input change.delegate=\"dataTable.filterList($event)\" id=\"createdDate\" type=\"date\" class=\"form-control datepicker\" data-dateformat=config.DATE_FORMAT_TABLE>\r\n               </th>\r\n               <th>\r\n                  <select change.delegate=\"dataTable.filterList($event)\" class=\"form-control \" id=\"courseId\">\r\n                   <option value=\"\"></option>\r\n                   <option  value=\"config.SANDBOX_ID\">Sandbox</option>\r\n                   <option  value=\"\">Regular</option>\r\n                 </select>\r\n               </th>\r\n               <th>\r\n                 <select change.delegate=\"dataTable.filterList($event)\" class=\"form-control \" id=\"requestStatus\">\r\n                   <option value=\"\"></option>\r\n                   <option repeat.for=\"status of config.REQUEST_STATUS\" value=\"${status.code}\">${status.description}</option>\r\n                 </select>\r\n               </th>\r\n               <th></th>\r\n               <th>\r\n                 <select change.delegate=\"dataTable.filterList($event)\" class=\"form-control \" id=\"productId\" type=\"id\" compare=\"id\">\r\n                   <option value=\"\"></option>\r\n                   <option repeat.for=\"product of products.productsArray\" value=\"${product._id}\">${product.name}</option>\r\n                 </select>\r\n               </th>\r\n               <th>\r\n                 <input input.delegate=\"dataTable.filterList($event)\" id=\"requestId.personId\" type=\"text\" placeholder=\"Filter Name\" class=\"form-control\">\r\n               </th>\r\n             </tr>\r\n             <tr click.trigger=\"selectRequest($index, $event, request)\" repeat.for=\"request of displayArray | pageFilter:dataTable.startRecord:dataTable.take\">\r\n               <td data-title=\"requestNo\">${request.requestNo}</td>\r\n               <td data-title=\"requiredDate\">${request.requiredDate | dateFormat:config.DATE_FORMAT_TABLE}</td>\r\n               <td data-title=\"dateCreated\">${request.createdDate | dateFormat:config.DATE_FORMAT_TABLE}</td>\r\n               <td data-title=\"courseId\">${request.requestId.courseId | sandbox:config.SANDBOX_ID}</td>\r\n               <td data-title=\"status\">${request.requestStatus | lookupDescription:config.REQUEST_STATUS}</td>\r\n               <td data-title=\"ids-requested\">${request.requestId | idsRequested}\r\n               <td data-title=\"product\">${request.productId | productName:products.productsArray}</td>\r\n               <td data-title=\"personId\">${request.requestId.personId | personName:people.peopleArray}</td>\r\n             </tr>\r\n           </tbody>\r\n         </table>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</template>\r\n"; });
define('text!modules/facco/components/viewRequestsForm.html', ['module'], function(module) { module.exports = "<template>\r\n  <div class=\"bottomMargin list-group-item leftMargin rightMargin\">\r\n    <span click.delegate=\"back()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Back\"><i class=\"fa fa-arrow-left fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n    <span click.delegate=\"save()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Save\"><i class=\"fa fa-floppy-o fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n    <span click.delegate=\"customerAction()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Customer Action\"><i class=\"fa fa-user fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n    <span click.delegate=\"openSettings()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Settings\"><i class=\"fa fa-cog fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n  </div>    \r\n  <div class=\"row leftMargin rightMargin\">\r\n    <div class=\"col-lg-5\" show.bind=\"showRequest\">\r\n        <div class=\"panel panel-primary topMargin\">\r\n        <div class=\"panel-heading\">\r\n            <h3 class=\"panel-title\">${requests.selectedRequestDetail.productId | productName:products.productsArray}</h3>\r\n        </div>\r\n        <div class=\"panel-body\">        \r\n            <div show.bind=\"requests.selectedRequestDetail.requestStatus == config.ASSIGNED_REQUEST_CODE\">\r\n            <table class=\"table table-striped table-hover\">\r\n            <thead>\r\n                <tr>\r\n                <th>System</th>\r\n                <th>Client</th>\r\n                <th>Student IDs</th>\r\n                <th>Student Password</th>\r\n                </tr>\r\n            </thead>\r\n            <tbody>\r\n                <tr repeat.for=\"assign of requests.selectedRequestDetail.assignments\" click.trigger=\"selectAssignment(assign, $index)\">\r\n                <td>${assign.systemId | lookupSid:systems.systemsArray}</td>\r\n                <td>${assign.client}</td>\r\n                <td>${assign.studentUserIds}</td>\r\n                <td>${assign.studentPassword}</td>\r\n                </tr>\r\n            </tbody>\r\n            </table>\r\n            <h4 class=\"topMargin\"><strong>Faculty IDs</strong></h4>\r\n            <div class=\"form-group\">\r\n            <h5 class=\"panel-title\">Faculty IDs: ${requests.selectedRequestDetail.assignments[selectedAssignmentIndex].facultyUserIds}</h3>\r\n            </div>\r\n            <div class=\"form-group\">\r\n            <h5 class=\"panel-title\">Faculty Password: ${requests.selectedRequestDetail.assignments[selectedAssignmentIndex].facultyPassword}</h5>\r\n            </div>\r\n            <h4 class=\"topMargin\"><strong>System Details</strong></h4>\r\n            <div class=\"form-group\">\r\n            <h5 class=\"panel-title\">SID: ${systems.selectedSystem.sid}</h3>\r\n            </div>\r\n            <div class=\"form-group\">\r\n            <h5 class=\"panel-title\">Server: ${systems.selectedSystem.server}</h3>\r\n            </div>\r\n            <div class=\"form-group\">\r\n            <h5 class=\"panel-title\">System Number: ${systems.selectedSystem.instance}</h3>\r\n            </div>\r\n            <div class=\"form-group\">\r\n            <h5 class=\"panel-title\">ITS: ${systems.selectedSystem.its}</h3>\r\n            </div>\r\n            <div class=\"col-lg-12 topMargin\" innerhtml.bind=\"requests.selectedRequestDetail.techComments\"></div>\r\n        </div>\r\n        </div>\r\n    </div>\r\n  </div>\r\n</template>"; });
