define('text!modules/user/support/downloads.html', ['module'], function(module) { module.exports = "<template>\r\n    <div class=\"panel panel-default\">\r\n      <div class=\"panel-body\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-4\">\r\n            <div class=\"form-group topMargin\">\r\n                <select value.bind=\"typeSelected\" change.delegate=\"typeChanged($event)\" id=\"session\" class=\"form-control\">\r\n                <option value=\"\">Select a Category</option>\r\n                <option repeat.for=\"type of downloads.appCatsArray\"\r\n                        value=\"${type.code}\">${type.description}</option>\r\n                </select>\r\n            </div>\r\n            </div>\r\n        </div>\r\n\r\n        <div show.bind=\"typeSelected != ''\" class=\"col-lg-12 col-sm-12\" style='padding:15px;'>\r\n            <div class='row'>\r\n                <div class='col-lg-12 bottomMargin'>\r\n                    <table id=\"newsTable\" class=\"table table-striped table-hover\">\r\n                        <thead>\r\n                            <tr>\r\n                                <td colspan='3'>\r\n                                    <compose view=\"../../../resources/elements/table-navigation-bar.html\"></compose>\r\n                                </td>\r\n                            </tr>\r\n                            <tr>\r\n                                <th >Name </th>\r\n                                <th>File</th>\r\n                                <th >Decription</th>\r\n                            </tr>\r\n                        </thead>\r\n                        <tbody>\r\n                            <tr repeat.for=\"item of displayArray | pageFilter:dataTable.startRecord:dataTable.take\">\r\n                                <td data-title=\"name\" class=\"col-md-2\">${item.name}</td>\r\n                                <td data-title=\"originalFilename\" class=\"col-md-2\">\r\n                                    <a href=\"${config.DOWNLOAD_FILE_DOWNLOAD_URL}/${item.file.originalFilename}\" target=\"_blank\">${item.file.originalFilename}</a>\r\n                                </td>\r\n                                <td data-title=\"description\" class=\"col-md-8\">\r\n                                    <div>${item.description}</div>\r\n                                </td>\r\n                            </tr>\r\n                        </tbody>\r\n                    </table>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n   </div>\r\n</template>"; });
define('text!modules/user/support/links.html', ['module'], function(module) { module.exports = "<template>\r\n    <div class=\"row\">\r\n      <div repeat.for=\"category of linkArray\" class=\"col-lg-3\">\r\n        <h2>${category.category}</h2>\r\n        <div>\r\n          <a repeat.for=\"link of category.links\" href=\"${link.url}\" class=\"list-group-item\" target=\"_blank\">\r\n            <h4 class=\"list-group-item-heading\">${link.title}</h4>\r\n            <p class=\"list-group-item-text\">${link.content}</p>\r\n          </a>\r\n        </div>\r\n      </div>\r\n  </div>\r\n</template>\r\n"; });
