define('text!modules/admin/system/components/sessionForm.html', ['module'], function(module) { module.exports = "<template>\r\n  <div class=\"col-lg-12\">\r\n    <div class=\"bottomMargin list-group-item leftMargin rightMargin\">\r\n      <span click.delegate=\"back()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Back\"><i class=\"fa fa-arrow-left fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n      <span click.delegate=\"save()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Save\"><i class=\"fa fa-floppy-o fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n      <span click.delegate=\"cancel()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Cancel Changes\"><i class=\"fa fa-ban fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n    </div>  \r\n       \r\n      <div class=\"form-group topMargin row\">\r\n        <label for=\"editSession\" class=\"col-sm-2 form-control-label topMargin\">Session</label>\r\n        <div class=\"col-sm-10\">\r\n          <select value.bind=\"sessions.selectedSession.session\" class=\"form-control topMargin\" id=\"editSession\">\r\n            <option></option>\r\n            <option repeat.for=\"session of config.SESSION_PARAMS\">${session.session}</option>\r\n          </select>\r\n        </div>\r\n      </div>\r\n      <div class=\"form-group row\">\r\n        <label for=\"editYear\" class=\"col-sm-2 form-control-label topMargin\">Year</label>\r\n        <div class=\"col-sm-10\">\r\n          <input value.bind=\"sessions.selectedSession.year\" id=\"editYear\" class=\"topMargin form-control\" placeholder=\"Year\" type=\"text\" />\r\n        </div>\r\n      </div>\r\n      <div class=\"form-group row\">\r\n        <label for=\"editStartDate\" class=\"col-sm-2 form-control-label topMargin\">Start Date</label>\r\n        <div class=\"col-sm-10\">\r\n          <input value.bind=\"sessions.selectedSession.startDate | datePickerDate\" id=\"editStartDate\" class=\"topMargin form-control\" type=\"date\" /> \r\n        </div>\r\n      </div>\r\n      <div class=\"form-group row\">\r\n        <label for=\"editEndDate\" class=\"col-sm-2 form-control-label topMargin\">End Date</label>\r\n        <div class=\"col-sm-10\">\r\n          <input value.bind=\"sessions.selectedSession.endDate | datePickerDate\" id=\"editEndDate\" class=\"topMargin form-control\"  type=\"date\" />\r\n        </div>\r\n      </div>\r\n      <div class=\"form-group row\">\r\n        <label for=\"editRequestsOpenDate\" class=\"col-sm-2 form-control-label topMargin\">Requests Open</label>\r\n        <div class=\"col-sm-10\">\r\n          <input value.bind=\"sessions.selectedSession.requestsOpenDate | datePickerDate\" id=\"editRequestsOpenDate\" class=\"topMargin form-control\"  type=\"date\" />\r\n        </div>\r\n      </div>\r\n      <div class=\"form-group\">\r\n        <label for=\"editStatus\" class=\"col-sm-2 form-control-label topMargin bottomMargin\">Status</label>\r\n        <div class=\"col-sm-10\">\r\n          <select value.bind=\"sessions.selectedSession.sessionStatus\" id=\"editStatus\" class=\"form-control topMargin bottomMargin\" id=\"editStatus\">\r\n            <option value=\"Closed\">Closed</option>\r\n            <option value=\"Active\">Active</option>\r\n            <option value=\"Requests\">Requests</option>\r\n            <option value=\"Next\">Next</option>\r\n          </select>\r\n        </div>\r\n      </div>\r\n    </div>\r\n</template>"; });
define('text!modules/admin/system/components/sessionTable.html', ['module'], function(module) { module.exports = "<template>\r\n    <div class='row'>\r\n        <div class='col-lg-10 col-lg-offset-1 bottomMargin'>\r\n            <table id=\"sessionsTable\" class=\"table table-striped table-hover\">\r\n                <thead>\r\n                    <tr>\r\n                        <td colspan='6'>\r\n                            <div class=\"checkbox\">\r\n                                <label>\r\n                                    <input checked.bind=\"isChecked\" change.trigger=\"filterOutClosed()\" type=\"checkbox\"> Hide inactive sessions\r\n                                </label>\r\n                            </div>\r\n                        </td>\r\n                        <tr>\r\n                            <td colspan='6'>\r\n                                <compose view=\"../../../../resources/elements/table-navigation-bar.html\"></compose>\r\n                            </td>\r\n                        </tr>\r\n                         <tr>\r\n                            <td colspan='6'>\r\n                                <span click.delegate=\"refresh()\" class=\"smallMarginRight\"><i class=\"fa fa-refresh\" aria-hidden=\"true\"></i></span>\r\n                                <span click.delegate=\"new()\"><i class=\"fa fa-plus\" aria-hidden=\"true\"></i></span>\r\n                                <span class=\"pull-right\" id=\"spinner\" innerhtml.bind=\"spinnerHTML\"></span>\r\n                            </td>\r\n                        </tr>\r\n                        <tr>\r\n                            <th>Session <span click.trigger=\"dataTable.sortArray('session')\"><i class=\"fa fa-sort\"></i></span></th>\r\n                            <th>Start Date <span click.trigger=\"dataTable.sortArray('startDate')\"><i class=\"fa fa-sort\"></i></span></th>\r\n                            <th>End Date <span click.trigger=\"dataTable.sortArray('endDate')\"><i class=\"fa fa-sort\"></i></span></th>\r\n                            <th>Requests Open <span click.trigger=\"dataTable.sortArray('requestsOpenDate')\"><i class=\"fa fa-sort\"></i></span></th>\r\n                            <th>Status</th>\r\n                            <th></th>\r\n                        </tr>\r\n                </thead>\r\n                <tbody>\r\n                    <tr repeat.for=\"session of displayArray | pageFilter:dataTable.startRecord:dataTable.take\">\r\n                        <td data-title=\"Session\" click.trigger=\"edit($index, $event)\">${session.session}</td>\r\n                        <td data-title=\"StartDate\" click.trigger=\"edit($index, $event)\">\r\n                            <div style=\"width: 100px\">${session.startDate | dateFormat:config.DATE_FORMAT_TABLE}</div>\r\n                        </td>\r\n                        <td data-title=\"EndDate\" click.trigger=\"edit($index, $event)\">\r\n                            <div style=\"width: 100px\">${session.endDate | dateFormat:config.DATE_FORMAT_TABLE}</div>\r\n                        </td>\r\n                        <td data-title=\"RequestsOpen\" click.trigger=\"edit($index, $event)\">\r\n                            <div style=\"width: 100px\">${session.requestsOpenDate | dateFormat:config.DATE_FORMAT_TABLE}</div>\r\n                        </td>\r\n                        <td data-title=\"createdDate\" click.trigger=\"edit($index, $event)\">${session.sessionStatus}</td>\r\n                        <td data-title=\"Update\">\r\n                            <div style=\"width: 100px\">\r\n                                <button click.trigger=\"updateStatus($index, session, $event)\" class='btn btn-primary btn-fill btn-sm' show.bind=\"session.sessionStatus === 'Active'\"\r\n                                value=\"Close\">Close</button>\r\n                                <button click.trigger=\"updateStatus($index, session, $event)\" class='btn btn-primary btn-fill btn-sm' show.bind=\"session.sessionStatus === 'Requests'\"\r\n                                value=\"Activate\">Activate</button>\r\n                                <button click.trigger=\"updateStatus($index, session, $event)\" class='btn btn-primary btn-fill btn-sm' show.bind=\"session.sessionStatus === 'Next'\"\r\n                                value=\"Open\">Open</button>\r\n                            </div>\r\n                        </td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n        </div>\r\n    </div>\r\n</div>\r\n</template>"; });
define('text!modules/admin/system/components/systemForm.html', ['module'], function(module) { module.exports = "<template>\r\n    <div class=\"col-lg-12\">\r\n\r\n        <div class=\"bottomMargin list-group-item leftMargin rightMargin\">\r\n            <span click.delegate=\"back()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Back\"><i class=\"fa fa-arrow-left fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n            <span click.delegate=\"save()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Save\"><i class=\"fa fa-floppy-o fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n            <span click.delegate=\"cancel()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Cancel Changes\"><i class=\"fa fa-ban fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n            <span click.delegate=\"delete()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Delete\"><i class=\"fa fa-trash fa-lg fa-border text-danger\" aria-hidden=\"true\"></i></span>\r\n        </div>  \r\n\r\n            <!-- Edit Form -->\r\n            <div class=\" col-lg-6 topMargin\">\r\n                <div class=\"col-sm-12 col-lg-12\">\r\n                    <div class=\"form-group topMargin\">\r\n                        <label for=\"editSid\" class=\"col-sm-3 form-control-label\">SID</label>\r\n                        <div class=\"col-sm-8\">\r\n                            <input value.bind=\"systems.selectedSystem.sid\" id=\"editSid\" class=\"form-control\" placeholder=\"SID\" type=\"text\" />\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n                <div class=\"col-sm-12 col-lg-12\">\r\n                    <div class=\"form-group\">\r\n                        <label class=\"col-sm-3 form-control-label hideOnPhone\">Status</label>\r\n                        <div class=\"col-sm-8\">\r\n                            <div class=\"checkbox\">\r\n                                <label class=\"pull-left\">\r\n                                    <input checked.bind=\"systems.selectedSystem.active\" id=\"activeCheckBox\" type=\"checkbox\" data-toggle=\"checkbox\"> Active\r\n                                </label>\r\n                            </div>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n                <div class=\"col-sm-12 col-lg-12\">\r\n                    <div class=\"form-group\">\r\n                        <label for=\"editDesc\" class=\"col-sm-3 form-control-label\">Description</label>\r\n                        <div class=\"col-sm-8\">\r\n                            <input value.bind=\"systems.selectedSystem.description\" id=\"editDesc\" class=\"form-control input-md\" placeholder=\"Description\"\r\n                            type=\"text\" />\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n                <div class=\"col-sm-12 col-lg-12\">\r\n                    <div class=\"form-group\">\r\n                        <label for=\"editServer\" class=\"col-sm-3 form-control-label topMargin\">Server</label>\r\n                        <div class=\"col-sm-8\">\r\n                            <input value.bind=\"systems.selectedSystem.server\" id=\"editServer\" class=\"topMargin form-control input-md\" placeholder=\"Server\"\r\n                            type=\"text\" />\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n                <div class=\"col-sm-12 col-lg-12\">\r\n                    <div class=\"form-group\">\r\n                        <label for=\"editInst\" class=\"col-sm-3 form-control-label topMargin\">Instance</label>\r\n                        <div class=\"col-sm-8\">\r\n                            <input value.bind=\"systems.selectedSystem.instance\" id=\"editInst\" class=\"topMargin form-control input-md\" placeholder=\"Instance\"\r\n                            type=\"text\" />\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n                <div class=\"col-sm-12 col-lg-12\">\r\n                    <div class=\"form-group\">\r\n                        <label for=\"editIts\" class=\"col-sm-3 form-control-label topMargin\">ITS</label>\r\n                        <div class=\"col-sm-8\">\r\n                            <input value.bind=\"systems.selectedSystem.its\" id=\"editIts\" class=\"topMargin form-control input-md\" placeholder=\"ITS\"\r\n                            type=\"text\" />\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n                <div class=\"col-sm-12 col-lg-12\">\r\n                    <div class=\"form-group\">\r\n                        <label for=\"editTerms\" class=\"col-sm-3 form-control-label topMargin\">Terms</label>\r\n                        <div class=\"col-sm-8\">\r\n                            <input value.bind=\"systems.selectedSystem.terms\" id=\"editTerms\" class=\"topMargin form-control input-md\" placeholder=\"Terms\"\r\n                            type=\"text\" />\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n                <div class=\"col-sm-12 col-lg-12 bottomMargin\">\r\n                    <div class=\"form-group\">\r\n                        <label for=\"editIdsAvailable\" class=\"col-sm-3 form-control-label topMargin\">IDS Available</label>\r\n                        <div class=\"col-sm-8\">\r\n                            <input value.bind=\"systems.selectedSystem.idsAvailable\" id=\"editIdsAvailable\" class=\"topMargin form-control input-md\"\r\n                            placeholder=\"IDS Available\" type=\"text\" />\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n                <div class=\"col-sm-12 col-lg-12 bottomMargin\">\r\n                    <div class=\"form-group\">\r\n                        <label for=\"editProduct\" class=\"col-sm-3 form-control-label topMargin\">Product</label>\r\n                        <div class=\"col-sm-8\">\r\n                            <input readonly value.bind=\"systems.selectedSystem.productId | productName:products.productsArray\" id=\"editProductId\" class=\"topMargin form-control input-md\"\r\n                            placeholder=\"Product\" type=\"text\" />\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n             <div class=\" col-lg-6 topMargin\">\r\n                <div if.bind=\"interfaceUpdate\" class=\"col-sm-12 col-lg-12\">\r\n                    <edit-client client-obj.bind=\"systems.selectedClient\" show-session-select.bind=true sid.bind=\"systems.selectedSystem.sid\"\r\n                    show-form.two-way=\"interfaceUpdate\" session-array.bind=\"sessions.sessionsArray\" action1.call=\"deleteClient()\"\r\n                    action2.call=\"saveClient()\">\r\n                    </edit-client>\r\n                </div>\r\n\r\n                <div show.bind=\"!interfaceUpdate\">\r\n                    <div class=\"row\">\r\n                        <div class=\"bottomMargin list-group-item col-sm-9\">\r\n                            <span click.delegate=\"generateClients()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Add Clients\"><i class=\"fa fa-plus fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n                            <span click.delegate=\"refreshClients()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Refresh Clients\"><i class=\"fa fa-refresh fa-lg fa-border text-danger\" aria-hidden=\"true\"></i></span>\r\n                            <span click.delegate=\"deleteClients()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Delete Clients\"><i class=\"fa fa-trash-o fa-lg fa-border text-danger\" aria-hidden=\"true\"></i></span>\r\n                        </div>  \r\n                    </div>\r\n                    \r\n                    <div class=\"row topMargin bottomMargin\">\r\n                        <div class=\"form-group col-sm-2 topMargin\">\r\n                            <input value.bind=\"editFirstClient\" style=\"width:75px;margin-right:10px;\" id=\"editFirstClient\" placeholder=\"Start\" class=\"form-control input-sm\"\r\n                            type=\"number\" />\r\n                        </div>\r\n                        <div class=\"form-group col-sm-2 topMargin\">\r\n                            <input value.bind=\"editLastClient\" style=\"width:75px;margin-right:10px;\" id=\"editLastClient\" placeholder=\"End\" class=\"form-control input-sm\"\r\n                            type=\"number\" />\r\n                        </div>\r\n                        <div class=\"form-group col-sm-2 topMargin\">\r\n                            <input value.bind=\"systems.selectedSystem.idsAvailable\" style=\"width:75px;margin-right:10px;\" id=\"editClientIdsAvailable\"\r\n                            placeholder=\"IDS Available\" class=\"form-control input-sm\" type=\"number\" />\r\n                        </div>\r\n                        <div class=\"fom-group col-sm-3 topMargin\">\r\n                            <select value.bind=\"editClientStatus\" class=\"form-control\" data-title=\"Single Select\" data-style=\"btn-default btn-block\"\r\n                            data-menu-style=\"dropdown-blue\">\r\n                                <option repeat.for=\"status of config.CLIENT_STATUSES\" value=\"${status.code}\">${status.description}\r\n                                    <option>\r\n                            </select>\r\n                        </div>\r\n                    </div>\r\n\r\n                        <div show.bind=\"systems.selectedSystem.clients.length > 0\" class=\"topMargin col-sm-9\">\r\n                            <div class=\"panel panel-default\" >\r\n                                <div class=\"panel-body\">\r\n                                    <table class=\"table\" style=\"display: block;height: 400px;overflow-y: scroll;width: 500px;\">\r\n                                        <thead>\r\n                                            <tr>\r\n                                                <th style=\"width:150px;\">Client</th>\r\n                                                <th style=\"width:200px;\">Status</th>\r\n                                                <th style=\"width:200px;\">IDS Available</th>\r\n                                            </tr>\r\n                                        </thead>\r\n                                        <tbody>\r\n                                            <tr click.trigger=\"editAClient(client, $index, $event)\" repeat.for=\"client of systems.selectedSystem.clients | sortArray:'client':'ASC'\">\r\n                                                <td>${client.client}</td>\r\n                                                <td>${client.clientStatus | lookupDescription:config.CLIENT_STATUSES}</td>\r\n                                                <td>${client.idsAvailable}</td>\r\n                                            </tr>\r\n                                        </tbody>\r\n                                    </table>\r\n                                </div>\r\n                            </div>\r\n\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n             </div>\r\n        </div>\r\n\r\n\r\n        </div>\r\n</template>\r\n"; });
