define('text!modules/admin/system/components/systemTable.html', ['module'], function(module) { module.exports = "<template>\r\n    <div class='row'>\r\n        <div class='col-lg-12'>\r\n            <table id=\"systemsTable\" class=\"table table-striped table-hover\">\r\n                <thead>\r\n                    <tr>\r\n                        <td colspan='5'>\r\n                            <compose view=\"../../../../resources/elements/table-navigation-bar.html\"></compose>\r\n                        </td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td colspan=5>\r\n                            <span click.delegate=\"refresh()\" class=\"smallMarginRight\"><i class=\"fa fa-refresh\" aria-hidden=\"true\"></i></span>\r\n                            <span click.delegate=\"new()\"><i class=\"fa fa-plus\" aria-hidden=\"true\"></i></span>\r\n                            <span class=\"pull-right\" id=\"spinner\" innerhtml.bind=\"spinnerHTML\"></span>\r\n                        </td>\r\n                    </tr>\r\n                    <tr>\r\n                        <th style=\"width:100px;\">SID <span click.trigger=\"dataTable.sortArray('sid')\"><i class=\"fa fa-sort\"></i></span></th>\r\n                        <th>Description <span click.trigger=\"dataTable.sortArray('description')\"><i class=\"fa fa-sort\"></i></span></th>\r\n                        <th>Server <span click.trigger=\"dataTable.sortArray('server')\"><i class=\"fa fa-sort\"></i></span></th>\r\n                        <th>Instance</th>\r\n                        <th>Status</th>\r\n                    </tr>\r\n                </thead>\r\n                <tbody>\r\n                    <tr>\r\n                        <th class=\"hasinput\">\r\n                            <input input.delegate=\"dataTable.filterList($event)\" id=\"sid\" type=\"text\" placeholder=\"Filter SID\" class=\"form-control\">\r\n                        </th>\r\n                        <th>\r\n                            <input input.delegate=\"dataTable.filterList($event)\" id=\"description\" type=\"text\" placeholder=\"Filter description\" class=\"form-control\">\r\n                        </th>\r\n                        <th>\r\n                            <input input.delegate=\"dataTable.filterList($event)\" id=\"server\" type=\"text\" placeholder=\"Filter server\" class=\"form-control\">\r\n                        </th>\r\n                        <th></th>\r\n                        <th>\r\n                            <select md-select change.delegate=\"dataTable.filterList($event)\" class=\"form-control \" id=\"active\" compare=\"boolean\">\r\n                                <option value=\"\"></option>\r\n                                <option value=true>Active</option>\r\n                                <option value=false>Inactive</option>\r\n                            </select>\r\n                        </th>\r\n                    </tr>\r\n                    <tr click.trigger=\"edit($index, $event)\" repeat.for=\"system of displayArray | pageFilter:dataTable.startRecord:dataTable.take\">\r\n                        <td data-title=\"Session\">${system.sid}</td>\r\n                        <td data-title=\"StartDate\">${system.description}</td>\r\n                        <td data-title=\"EndDate\">${system.server}</td>\r\n                        <td data-title=\"RequestsOpen\">${system.instance}</td>\r\n                        <td data-title=\"createdDate\">${system.active | translateStatus}</td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n        </div>\r\n    </div>    \r\n</template>"; });
define('text!modules/tech/requests/components/requestDetailDetails.html', ['module'], function(module) { module.exports = "<template>\r\n     <div class=\"col-lg-5\" show.bind=\"showRequest\">\r\n    <div class=\"panel panel-primary topMargin\">\r\n      <div class=\"panel-heading\">\r\n        <h3 class=\"panel-title\">${selectedProductID | productName:products.productsArray}</h3>\r\n      </div>\r\n      <div class=\"panel-body\">\r\n        <h5>Request status: ${requests.selectedRequestDetail.requestStatus | lookupDescription:config.REQUEST_STATUS}</h5>\r\n        <h5>Assigned system: ${requests.selectedRequestDetail.assignment.systemId | lookupSid:systems.systemsArray}</h5>\r\n        <h5>Assigned client: ${requests.selectedRequestDetail.assignment.clientId | lookupSid:systems.systemsArray}</h5>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</template>"; });
define('text!modules/tech/requests/components/requestDetails.html', ['module'], function(module) { module.exports = "<template>\r\n     <div class=\"row\">\r\n        <div class=\"col-lg-12\">\r\n          <div  class=\"panel panel-default topMargin\">\r\n            <div class=\"panel-body leftJustify\">\r\n              <div class=\"bottomMargin\">\r\n                <button class=\"btn btn-primary btn-fill btn-wd\" click.delegate=\"save()\">Save</button>\r\n                <button class=\"btn btn-primary btn-fill btn-wd\" click.delegate=\"cancel()\">Cancel</button>\r\n              </div>\r\n              <div class=\"form-group\" show.bind=\"requests.selectedRequest.courseId != config.SANDBOX_ID\">\r\n                <div class=\"row\">\r\n                  <div class=\"col-lg-6\">\r\n                      <h5>Undergraduates: ${requests.selectedRequest.undergradIds}</h5>\r\n                  </div>\r\n                  <div class=\"col-lg-6\">\r\n                      <h5>Graduates: ${requests.selectedRequest.graduateIds}</h5>\r\n                  </div>\r\n                </div>\r\n                 \r\n                  <div class=\"row\">\r\n                    <div class=\"col-lg-4\">\r\n                        <div class=\"form-group\">\r\n                            <label for=\"editAddUnder\" class=\"control-label\">Add Undergraduates</label>\r\n                            <input value.bind=\"requests.selectedRequest.addUndergraduates\" id=\"editAddUnder\" class=\"form-control input-sm\" placeholder=\"Addiiontal undergraduates\" type=\"number\" />\r\n                        </div>\r\n                    </div>\r\n                              \r\n                    <div class=\"col-lg-4 col-lg-offset-2\">\r\n                        <div class=\"form-group\">\r\n                            <label for=\"editAddGrad\" class=\"control-label\">Add Graduate</label>\r\n                             <input value.bind=\"requests.selectedRequest.addGraduates\" type=\"number\" id=\"editAddGrad\" class=\"form-control input-sm\" placeholder=\"Addiiontal Graduates\"/>\r\n                        </div>\r\n                    </div>\r\n                  </div>\r\n                \r\n                \r\n                 <label show.bind=\"request.addUndergraduates > 0\">Additional Undergraduates: ${requests.selectedRequest.addUndergraduates}</label>\r\n                 <label show.bind=\"request.addGraduates > 0\">Additional Graduates: ${requests.selectedRequest.addGraduates}</label>\r\n              </div>\r\n              <div class=\"leftJustify\">\r\n                <div class=\"row\">\r\n                  <div class=\"col-lg-6\">\r\n                    <div class=\"form-group topMargin\">\r\n                      <div class=\"input-group\">\r\n                        <div>\r\n                          <label for=\"beginDate\" class=\"leftJustify\">Date the course begins</label>\r\n                          <input change.trigger=\"changeBeginDate()\" type=\"date\" value.bind=\"requests.selectedRequest.startDate\"\r\n                                class=\"form-control\" id=\"beginDate\">\r\n                        </div>\r\n                      </div>\r\n                    </div>\r\n                  </div>\r\n                  <div class=\"col-lg-6\">\r\n                    <div class=\"form-group topMargin\">\r\n                      <div class=\"input-group\">\r\n                        <div>\r\n                          <label for=\"endDate\" class=\"leftJustify\">Date the course ends</label>\r\n                          <input change.trigger=\"changeEndDate()\" type=\"date\" value.bind=\"requests.selectedRequest.endDate\"\r\n                                class=\"form-control\" id=\"endDate\">\r\n                        </div>\r\n                      </div>\r\n                    </div>\r\n                  </div>\r\n                </div>\r\n                \r\n              </div>\r\n               <textarea  placeholder=\"Additional Comments\" class=\"topMargin col-lg-12\" id=\"comments\"\r\n                value.bind=\"requests.selectedRequest.comments\" class=\"form-control\" rows=\"10\"></textarea>\r\n              \r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n</template>\r\n    "; });
define('text!modules/tech/requests/components/requestsTable.html', ['module'], function(module) { module.exports = "<template>\r\n  <div class=\"col-lg-10 col-lg-offset-1\">\r\n      <div class='row'>\r\n        <table id=\"peopleTable\" class=\"table table-striped table-hover\">\r\n            <thead>\r\n              <tr>\r\n                  <td colspan='8'>\r\n                      <compose view=\"../../../../resources/elements/table-navigation-bar.html\"></compose>\r\n                  </td>\r\n              </tr>\r\n              <tr>\r\n                  <td colspan='7'>\r\n                      <span click.delegate=\"refresh()\" class=\"smallMarginRight\"><i class=\"fa fa-refresh\" aria-hidden=\"true\"></i></span>\r\n                      <span class=\"pull-right\" id=\"spinner\" innerhtml.bind=\"spinnerHTML\"></span>\r\n                  </td>\r\n              </tr>\r\n             <tr>\r\n               <th class=\"col-xs-1\">No <span click.trigger=\"dataTable.sortArray('requestNo')\"><i class=\"fa fa-sort\"></i></span></th>\r\n               <th class=\"col-lg-1\">Due <span click.trigger=\"dataTable.sortArray('requiredDate')\"><i class=\"fa fa-sort\"></i></span></th>\r\n               <th class=\"col-lg-1\">Requested <span click.trigger=\"dataTable.sortArray('createdDate')\"><i class=\"fa fa-sort\"></i></span></th>\r\n               <th class=\"col-lg-1\">Type</th>\r\n               <th class=\"col-lg-1\">Status <span click.trigger=\"dataTable.sortArray('requestStatus', 'id', config.REQUEST_STATUS, 'code', 'description')\"><i class=\"fa fa-sort\"></i></span></th>\r\n               <th class=\"col-sm-1\">IDS Requestd</th>\r\n               <th class=\"col-lg-2\">Product <span click.trigger=\"dataTable.sortArray('productId', 'id', products.productsArray, '_id', 'name')\"><i class=\"fa fa-sort\"></i></span></th>\r\n               <th class=\"col-lg-1\">Faculty <span click.trigger=\"dataTable.sortArray('requestId.personId', 'id', people.peopleArray, '_id', 'fullName')\"><i class=\"fa fa-sort\"></i></span></th>\r\n             </tr>\r\n           </thead>\r\n           <tbody>\r\n             <tr>\r\n               <th></th>\r\n               <th>\r\n                 <input change.delegate=\"dataTable.filterList($event)\" id=\"requiredDate\" type=\"date\" class=\"form-control datepicker\" data-dateformat=config.DATE_FORMAT_TABLE>\r\n               </th>\r\n               <th>\r\n                 <input change.delegate=\"dataTable.filterList($event)\" id=\"createdDate\" type=\"date\" class=\"form-control datepicker\" data-dateformat=config.DATE_FORMAT_TABLE>\r\n               </th>\r\n               <th>\r\n                  <select change.delegate=\"dataTable.filterList($event)\" class=\"form-control \" id=\"requestId.courseId\" compare=\"obj\">\r\n                   <option value=\"\"></option>\r\n                   <option  value=\"${config.SANDBOX_ID}\">Sandbox</option>\r\n                   <option  value=\"\">Regular</option>\r\n                 </select>\r\n               </th>\r\n               <th>\r\n                 <select change.delegate=\"dataTable.filterList($event)\" class=\"form-control \" id=\"requestStatus\">\r\n                   <option value=\"\"></option>\r\n                   <option repeat.for=\"status of config.REQUEST_STATUS\" value=\"${status.code}\">${status.description}</option>\r\n                 </select>\r\n               </th>\r\n               <th></th>\r\n               <th>\r\n                 <select change.delegate=\"dataTable.filterList($event)\" class=\"form-control \" id=\"productId\" type=\"id\" compare=\"id\">\r\n                   <option value=\"\"></option>\r\n                   <option repeat.for=\"product of products.productsArray\" value=\"${product._id}\">${product.name}</option>\r\n                 </select>\r\n               </th>\r\n               <th>\r\n                 <input input.delegate=\"dataTable.filterList($event)\" id=\"requestId.personId\" type=\"text\" placeholder=\"Filter Name\" class=\"form-control\">\r\n               </th>\r\n             </tr>\r\n             <tr click.trigger=\"selectRequest($index, $event, request)\" repeat.for=\"request of displayArray | pageFilter:dataTable.startRecord:dataTable.take\">\r\n               <td data-title=\"requestNo\">${request.requestNo}</td>\r\n               <td data-title=\"requiredDate\">${request.requiredDate | dateFormat:config.DATE_FORMAT_TABLE}</td>\r\n               <td data-title=\"dateCreated\">${request.createdDate | dateFormat:config.DATE_FORMAT_TABLE}</td>\r\n               <td data-title=\"courseId\">${request.requestId.courseId | sandbox:config.SANDBOX_ID}</td>\r\n               <td data-title=\"status\">${request.requestStatus | lookupDescription:config.REQUEST_STATUS}</td>\r\n               <td data-title=\"ids-requested\">${request.requestId | idsRequested}\r\n               <td data-title=\"product\">${request.productId | productName:products.productsArray}</td>\r\n               <td data-title=\"personId\">${request.requestId.personId | personName:people.peopleArray}</td>\r\n             </tr>\r\n           </tbody>\r\n         </table>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</template>\r\n"; });
define('text!modules/tech/requests/components/viewRequestsForm.html', ['module'], function(module) { module.exports = "<template>\r\n  <div class=\"bottomMargin list-group-item leftMargin rightMargin\">\r\n    <span click.delegate=\"back()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Back\"><i class=\"fa fa-arrow-left fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n    <span click.delegate=\"save()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Save\"><i class=\"fa fa-floppy-o fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n    <span click.delegate=\"customerAction()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Customer Action\"><i class=\"fa fa-paper-plane fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n    <span click.delegate=\"openFacultyDetails()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Faculty Details\"><i class=\"fa fa-user fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n    <span click.delegate=\"openSettings()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Settings\"><i class=\"fa fa-cog fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n    <span click.delegate=\"openAudit()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Audit\"><i class=\"fa fa-history fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n  </div>\r\n  <div class=\"row leftMargin rightMargin\">\r\n    <div class=\"well col-lg-12\">\r\n      <div class=\"row\">\r\n        <div class=\"col-lg-2\">\r\n          <h3>Request No: ${requests.selectedRequestDetail.requestNo}</h3>\r\n        </div>\r\n        <div class=\"col-lg-10\">\r\n          <span show.bind=\"facultyDetails\">\r\n            <div class=\"row\">\r\n              <div class=\"col-lg-3\">\r\n                <h5>Faculty: ${people.selectedPerson.fullName}</h5>\r\n              </div>\r\n              <div class=\"col-lg-3\">\r\n                <h5>Email: ${people.selectedPerson.email}</h5>\r\n              </div>\r\n              <div class=\"col-lg-4\">\r\n                <h5>Institution: ${people.selectedPerson.institutionId | lookupValue:people.institutionsArray:'_id':'name'}</h5>\r\n              </div>\r\n            </div>\r\n            <div class=\"row\">\r\n              <div class=\"col-lg-3\">\r\n                <h5>Phone: ${people.selectedPerson.phone}</h5>\r\n              </div>\r\n              <div class=\"col-lg-3\">\r\n                <h5>Mobile: ${people.selectedPerson.mobile}</h5>\r\n              </div>\r\n            </div>\r\n          </span>\r\n          <div class=\"row\">\r\n            <div class=\"col-lg-3\">\r\n                <h5>Required Date: ${requests.selectedRequestDetail.requiredDate | dateFormat:config.DATE_FORMAT_TABLE}</h5>\r\n              </div>\r\n            <div class=\"col-lg-5\">\r\n                <h5>Product: ${requests.selectedRequestDetail.productId | productName:products.productsArray}</h5>\r\n            </div>\r\n          </div>\r\n\r\n          <div class=\"row\">\r\n            <div class=\"col-lg-3 topMargin\">\r\n                <h5><strong>IDs Required: ${idsRequired}</strong></h5>\r\n            </div>\r\n             <div class=\"col-lg-3 topMargin\">\r\n                <h5><strong>IDs Assigned: ${totalIdsAssigned}</strong></h5>\r\n            </div>\r\n             <div class=\"col-lg-3 topMargin\">\r\n                <h5><strong>IDs Remaining: ${idsRemaining}</strong></h5>\r\n            </div>\r\n          </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n  <div show.bind=\"showAudit\">\r\n    <table class=\"table table-striped table-hover\">\r\n      <thead>\r\n        <tr>\r\n          <th>Date</th>\r\n          <th>Property</th>\r\n          <th>Old Value</th>\r\n          <th>New Value</th>\r\n          <th>Person</th>\r\n        </tr>\r\n      </thead>\r\n      <tbody>\r\n        <tr  repeat.for=\"item of requests.selectedRequestDetail.requestId.audit\">\r\n          <td>${item.eventDate | dateFormat:config.DATE_FORMAT_TABLE}</td>\r\n          <td>${item.property}</td>\r\n          <td>${item.oldValue}</td>\r\n          <td>${item.newValue}</td>\r\n          <td>${item.personId | personName:people.peopleArray}</td>\r\n        </tr>\r\n      </tbody>\r\n    </table>\r\n  </div>\r\n  <div show.bind=\"!showAudit\" class=\"row leftMargin rightMargin\">\r\n    <div show.bind=\"showSettings\">\r\n      <div class=\"panel panel-default col-lg-12 leftMargin\">\r\n        <div class=\"panel-body\">\r\n          <div class=\"row\">\r\n            <div class=\"form-group col-lg-2\">\r\n              <label>Regular ID Buffer</label>\r\n              <input  value.bind=\"idBuffer\"  id=\"bufferIds\"  class=\"form-control\" type=\"number\" />\r\n              <label>Added to the number of ids requested.  Default is ${config.REGULAR_ID_BUFFER}</label>\r\n            </div>\r\n            <div class=\"form-group col-lg-2\">\r\n              <label>Number of Sandbox IDs</label>\r\n              <input  value.bind=\"sandBoxIDs\"  id=\"sandBoxIDs\"  class=\"form-control\" type=\"number\" />\r\n              <label>Number of sandbox IDs assigned.  Default is ${config.SANDBOX_ID_BUFFER}</label>\r\n            </div>\r\n\r\n          </div>\r\n          <span click.delegate=\"saveSettings()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Save\"><i class=\"fa fa-floppy-o fa-2x fa-border\" aria-hidden=\"true\"></i></span>\r\n          <span click.delegate=\"restoreDefaults()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Restore Defaults\"><i class=\"fa fa-refresh fa-2x fa-border\" aria-hidden=\"true\"></i></span>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <table class=\"table table-striped table-hover\">\r\n      <thead>\r\n        <tr>\r\n          <th class=\"col-sm-1\">System</th>\r\n          <th class=\"col-sm-1\">Client</th>\r\n          <th class=\"col-sm-1\">Assigned IDs</th>\r\n          <th>Student IDs</th>\r\n          <th>Student Password</th>\r\n          <th>Faculty IDs</th>\r\n          <th>Faculty Password</th>\r\n          <th>Assigned Date</th>\r\n          <th>Status</th>\r\n          <th></th>\r\n        </tr>\r\n      </thead>\r\n      <tbody>\r\n        <tr click.trigger=\"selectProposedClient($index, $event)\" repeat.for=\"client of assignmentDetails\" class=\"${client.notValid}\">\r\n          <td>${client.systemId | lookupSid:systems.systemsArray}</td>\r\n          <td>${client.client}</td>\r\n          <td>${client.idsAssigned}</td>\r\n          <td>${client.studentUserIds}</td>\r\n          <td>${client.studentPassword}</td>\r\n          <td>${client.facultyUserIds}</td>\r\n          <td>${client.facultyPassword}</td>\r\n          <td>${client.assignedDate | dateFormat:config.DATE_FORMAT_TABLE}</td>\r\n          <td>${client.notValid | overlap}\r\n          <td><span click.delegate=\"deleteProposedClient($index)\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Delete\"><i class=\"fa fa-trash-o\" aria-hidden=\"true\"></i></span></td>\r\n        </tr>\r\n      </tbody>\r\n    </table>\r\n  </div>\r\n  <span id=\"errorRange\"></span>\r\n  <div show.bind=\"!showAudit\" class=\"row leftMargin\">\r\n    <div class=\"panel panel-default col-lg-5 leftMargin\">\r\n      <div class=\"panel-body\">\r\n        <div show.bind=\"customerMessage\" class=\"row\">\r\n          <fieldset class=\"form-group\">\r\n            <div class=\"col-lg-12\">\r\n              <label for=\"studentIdTemplate\" class=\"col-sm-6 form-control-label topMargin\">\r\n                Customer Message\r\n                <span class=\"smallLeftMargin\" click.delegate=\"sendCustomerAction()\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Send\"><i class=\"fa fa-paper-plane\" aria-hidden=\"true\"></i></span>\r\n                <span class=\"smallLeftMargin\" click.delegate=\"cancelCustomerAction()\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Cancel\"><i class=\"fa fa-ban\" aria-hidden=\"true\"></i></span>\r\n              </label>\r\n              <textarea class=\"form-control\" id=\"customerMessage\" placeholder=\"Customer Message\" innerhtml.bind=\"message.customerMessage\" rows=\"8\"></textarea>\r\n            </div>\r\n          </fieldset>\r\n        </div>\r\n        <div class=\"row\">\r\n          <div class=\"col-lg-6\">\r\n                <div class=\"form-group\">\r\n                    <div class=\"checkbox\">\r\n                        <label class=\"pull-left\">\r\n                            <input checked.bind=\"provisionalAssignment\" id=\"provisionalCheckBox\" type=\"checkbox\" data-toggle=\"checkbox\"> Provisional\r\n                        </label>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <div class=\"form-group row\">\r\n            <div class=\"col-sm-12\">\r\n              <label for=\"studentIdTemplate\" class=\"col-sm-6 form-control-label topMargin\">\r\n                Student ID Template\r\n                <span class=\"smallLeftMargin\" click.delegate=\"openEditStudentTemplate()\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Edit Template\"><i class=\"fa fa-pencil\" aria-hidden=\"true\"></i></span>\r\n              </label>\r\n              <select id=\"studentIdTemplate\" multiple value.bind=\"selectedStudentIDTemplate\" class=\"form-control input-md topMargin\">\r\n                  <option repeat.for=\"template of studentIDTemplates\" value.bind=\"$index\">${template}</option>\r\n              </select>\r\n            </div>\r\n        </div>\r\n        <!-- Add Student ID Template -->\r\n            <div class=\"row\" show.bind=\"showAddStudentTemplate\">\r\n                <div class=\"panel panel-default col-md-12\">\r\n                    <div class=\"panel-body\">\r\n                        <div class=\"form-group\">\r\n                            <input id=\"number\" value.bind=\"products.selectedProduct.defaultStudentIdPrefix\" type=\"text\" placeholder=\"Template\" class=\"form-control input-lg\"/>\r\n                        </div>\r\n                    </div>\r\n                    <div class=\"bottomMargin\">\r\n                        <span click.delegate=\"saveStudentTemplate()\" class=\"smallLeftMargin\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Save\"><i class=\"fa fa-floppy-o fa-2x\" aria-hidden=\"true\"></i></span>\r\n                        <span click.delegate=\"cancelEditStudentTemplate()\" class=\"smallLeftMargin\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Cancel\"><i class=\"fa fa-ban fa-2x\" aria-hidden=\"true\"></i></span>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n          <div class=\"row\">\r\n            <div class=\"col-lg-6\">\r\n                <div class=\"form-group\">\r\n                    <div class=\"checkbox\">\r\n                        <label class=\"pull-left\">\r\n                            <input checked.bind=\"manualMode\" id=\"manualCheckBox\" type=\"checkbox\" change.trigger=\"changeManualMode()\" data-toggle=\"checkbox\"> Manual\r\n                        </label>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n            <!--\r\n            <div class=\"col-lg-6\">\r\n                <div class=\"form-group\">\r\n                    <div class=\"checkbox\">\r\n                        <label class=\"pull-left\">\r\n                            <input checked.bind=\"roundTo10\" id=\"roundTo10CheckBox\" type=\"checkbox\" change.trigger=\"changeRoundTo10()\" data-toggle=\"checkbox\"> Round to 10\r\n                        </label>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n             -->\r\n          </div>\r\n\r\n        <div class=\"row\">\r\n          <div class=\"form-group col-lg-6\">\r\n            <label>Student IDs</label>\r\n            <input value.bind=\"assignmentDetails[assignmentDetailIndex].studentUserIds\" id=\"proposedIDRange\"  placeholder=\"Proposed IDs\" class=\"form-control\" type=\"text\" />\r\n          </div>\r\n          <div class=\"form-group col-lg-2\">\r\n            <label>First ID</label>\r\n            <input disabled.bind=\"manualMode\" value.bind=\"firstID\" change.trigger =\"firstIDChanged()\" style=\"width:75px;margin-right:10px;\" id=\"firstID\"  class=\"form-control input-sm\"\r\n            type=\"number\" />\r\n          </div>\r\n          <div class=\"form-group col-lg-2\">\r\n            <label>Last ID</label>\r\n            <input  disabled.bind=\"manualMode\" value.bind=\"lastID\" change.trigger =\"lastIDChanged()\" style=\"width:75px;margin-right:10px;\" id=\"lastID\"  class=\"form-control input-sm\"\r\n            type=\"number\" />\r\n          </div>\r\n        </div>\r\n        <div class=\"row\">\r\n         <fieldset class=\"form-group\">\r\n            <div class=\"col-lg-6\">\r\n              <input value.bind=\"assignmentDetails[assignmentDetailIndex].studentPassword\" id=\"proposedStudentPassword\"  placeholder=\"Proposed Password\" class=\"form-control\" type=\"text\"/>\r\n            </div>\r\n        </fieldset>\r\n        </div>\r\n        <div class=\"row\">\r\n          <div class=\"form-group col-lg-6\">\r\n            <label>Faculty IDs</label>\r\n              <input value.bind=\"assignmentDetails[assignmentDetailIndex].facultyUserIds\" id=\"proposedFacultyIDRange\"  placeholder=\"Proposed Faculty IDs\" class=\"form-control\" type=\"text\" />\r\n          </div>\r\n          <div class=\"form-group col-lg-2\">\r\n            <label>First ID</label>\r\n            <input disabled.bind=\"manualMode\" value.bind=\"firstNumericFacID\" change.trigger =\"firstFacIDChanged()\" style=\"width:75px;margin-right:10px;\" id=\"firstFacID\"  class=\"form-control input-sm\"\r\n            type=\"number\" />\r\n          </div>\r\n          <div class=\"form-group col-lg-2\">\r\n            <label>Last ID</label>\r\n            <input  disabled.bind=\"manualMode\" value.bind=\"lastNumericFacID\" change.trigger =\"lastFacIDChanged()\" style=\"width:75px;margin-right:10px;\" id=\"lastFacID\"  class=\"form-control input-sm\"\r\n            type=\"number\" />\r\n          </div>\r\n        </div>\r\n        <div class=\"row\">\r\n          <fieldset class=\"form-group\">\r\n              <div class=\"col-lg-6\">\r\n                <input value.bind=\"assignmentDetails[assignmentDetailIndex].facultyPassword\" id=\"proposedFacultyPassword\"  placeholder=\"Proposed Faculty Password\" class=\"form-control\" type=\"text\"/>\r\n              </div>\r\n          </fieldset>\r\n        </div>\r\n         <div class=\"row\"\r\n        <fieldset class=\"form-group\">\r\n            <div class=\"col-lg-12\">\r\n              <textarea innerhtml.bind=\"requests.selectedRequestDetail.techComments\" class=\"form-control\" rows=\"10\"></textarea>\r\n            </div>\r\n        </fieldset>\r\n        </div>\r\n\r\n        <h3>Request Details</h3>\r\n          <h5 class=\"topMargin\">Product: ${requests.selectedRequestDetail.productId | productName:products.productsArray}</h5>\r\n          <h5 class=\"topMargin\">Required Date: ${requests.selectedRequestDetail.requiredDate | dateFormat:config.DATE_FORMAT_TABLE}</h5>\r\n          <h5 show.bind=\"requests.selectedRequestDetail.requestId.courseId != config.SANDBOX_ID\" class=\"topMargin\">Undergraduates: ${requests.selectedRequestDetail.requestId.undergradIds}</h5>\r\n          <h5 show.bind=\"requests.selectedRequestDetail.requestId.courseId != config.SANDBOX_ID\" class=\"topMargin\">Graduates: ${requests.selectedRequestDetail.requestId.graduateIds}</h5>\r\n          <h5 show.bind=\"requests.selectedRequestDetail.requestId.courseId != config.SANDBOX_ID\" class=\"topMargin\">Add Undergraduates: ${requests.selectedRequestDetail.requestId.addUndergraduates}</h5>\r\n          <h5 show.bind=\"requests.selectedRequestDetail.requestId.courseId != config.SANDBOX_ID\" class=\"topMargin\">Add Graduates: ${requests.selectedRequestDetail.requestId.addGraduates}</h5>\r\n          <h5 class=\"topMargin\">Begin Date: ${requests.selectedRequestDetail.requestId.startDate | dateFormat:config.DATE_FORMAT_TABLE}</h5>\r\n          <h5 class=\"topMargin\">End Date: ${requests.selectedRequestDetail.requestId.endDate | dateFormat:config.DATE_FORMAT_TABLE}</h5>\r\n          <div if.bind=\"requests.selectedRequestDetail.requestId.comments.length > 0\" class=\"row topMargin\">\r\n            <div class=\"col-sm-12\">\r\n              <div class=\"form-group\">\r\n                <h5 >Comments:</h5>\r\n                <textarea readonly class=\"topMargin form-control\"  innerhtml.bind=\"requests.selectedRequestDetail.requestId.comments\" rows=\"10\"></textarea>\r\n              </div>\r\n            </div>\r\n          </div>\r\n      </div>\r\n    </div>\r\n\r\n    <!-- Systems and Clients -->\r\n    <div  class=\"panel panel-default col-lg-6 rightMargin leftMargin\">\r\n      <div class=\"panel-body\">\r\n        <div class=\"row\">\r\n          <div class=\"col-lg-6 pull-right\">\r\n                <div class=\"col-lg-7\" show.bind=\"!sandBoxOnly\">\r\n                  <div class=\"checkbox\">\r\n                      <label>\r\n                          <input checked.bind=\"unassignedOnly\" id=\"unassignedCheckBox\" type=\"checkbox\" change.trigger=\"changeUnassignedOnly()\" data-toggle=\"checkbox\"> Unassigned only\r\n                      </label>\r\n                  </div>\r\n                </div>\r\n                <div class=\"col-lg-5 pull-right\">\r\n                  <div class=\"checkbox\">\r\n                      <label>\r\n                          <input checked.bind=\"sandBoxOnly\" id=\"sandBoxOnlyCheckBox\" type=\"checkbox\"  data-toggle=\"checkbox\"> Sandbox only\r\n                      </label>\r\n                  </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <div class=\"form-group\">\r\n            <label class=\"control-label col-sm-3 hideOnPhone\">Systems</label>\r\n            <select change.trigger=\"systemSelected()\" id=\"systemSelect\" value.bind=\"selectedSystem\" class=\"form-control\">\r\n                <option value=\"\">-- Select a System --</option>\r\n                <option repeat.for='system of products.selectedProduct.systems' value=\"${system.systemId}\">${system.sid}</option>\r\n            </select>\r\n          \r\n        </div>\r\n        <div show.bind=\"systems.selectedSystem.clients.length > 0\" class=\"topMargin\">\r\n          <table class=\"table table-striped table-hover\">\r\n            <thead>\r\n              <tr>\r\n                <th class=\"col-sm-1\">Client</th>\r\n                <th class=\"col-sm-1\">Status</th>\r\n                <th class=\"col-sm-1\">IDs Available</th>\r\n                <th class=\"col-sm-9\">Assignments</th>\r\n              </tr>\r\n            </thead>\r\n            <tbody>\r\n              <tr click.trigger=\"selectClient($index, client, $event)\" repeat.for=\"client of systems.selectedSystem.clients | filterClients:unassignedOnly:config.UNASSIGNED_CLIENT_CODE:sandBoxOnly:config.SANDBOX_CLIENT_CODE:selectedAssignedClient\">\r\n                <td>${client.client}</td>\r\n                <td>${client.clientStatus | lookupDescription:config.CLIENT_STATUSES}</td>\r\n                <td>${client.idsAvailable}</td>\r\n                <td>\r\n                  <table class=\"col-sm-12\">\r\n                    <tr repeat.for=\"assignment of client.assignments\">\r\n                      <td><div class=\"col-lg-12 list-group-item\"><h5 class=\"list-group-item-heading\">Request ${assignment.assignment | requestNumber:requests.requestsDetailsArray}</h5><p class=\"list-group-item-text\"><strong>${assignment.studentIDRange}</strong> <br>${assignment.facultyIDRange} <br> ${assignment.institutionId | lookupValue:people.institutionsArray:\"_id\":\"name\"}</p></div></td>\r\n                    </tr>\r\n                  </table>\r\n                </td>\r\n            </tbody>\r\n          </table>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n  </div>\r\n</template>\r\n"; });
define('text!modules/tech/requests/components/viewRequestsTable.html', ['module'], function(module) { module.exports = "<template>\r\n  <div class=\"row\">\r\n      <!-- Session Select -->\r\n      <div class=\"col-lg-4\">\r\n        <div class=\"form-group topMargin leftMargin\">\r\n            <select value.bind=\"selectedSession\" change.delegate=\"getRequests()\" id=\"session\" class=\"form-control\">\r\n              <option value=\"\">Select a session</option>\r\n              <option repeat.for=\"session of sessions.sessionsArray\"\r\n                      value.bind=\"session._id\">Session ${session.session} - ${session.year}</option>\r\n            </select>\r\n        </div>\r\n      </div>\r\n    </div>\r\n\r\n      <div show.bind=\"selectedSession\">\r\n        <div class=\"row\">\r\n          <div class=\"col-lg-12\">\r\n            <!-- Request Table -->\r\n            <compose view=\"./requestsTable.html\"></compose>\r\n          </div>\r\n          <!--\r\n          <div class=\"col-lg-6\">\r\n             Request Details\r\n            <compose view=\"./requestDetails.html\"></compose>\r\n          </div>\r\n          -->\r\n      </div>\r\n  </div>\r\n\r\n  <compose view=\"./requestDetailDetails.html\"></compose>\r\n\r\n</template>\r\n"; });
define('text!modules/tech/support/components/-time.html', ['module'], function(module) { module.exports = "<template>\r\n</template>"; });
define('text!modules/tech/support/components/1-time.html', ['module'], function(module) { module.exports = "<template>\r\n\r\n    <div class=\"smart-timeline-icon bottomMarginLg\" innerhtml.bind=\"event.personId | gravatarUrlId:people.peopleArray:100:1\">\r\n\r\n    </div>\r\n    <div class=\"smart-timeline-time\">\r\n    <small>${event.dateEntered | dateFormat:'YYYY-MM-DD':true}</small>\r\n    </div>\r\n    <div class=\"smart-timeline-content borderTop leftJustify\">\r\n    <div class=\"form-group\">\r\n        <p>${event.personId | personName:people.peopleArray}</p>\r\n        <label>Curriculum Title: ${event.content.curriculumTitle}</label>\r\n        <label class=\"col-sm-offset-1\">Exercise Module: ${event.content.exerciseModule}</label>\r\n        <label class=\"col-sm-offset-1\">Page: ${event.content.pageNumber}</label>\r\n        <label class=\"col-sm-offset-1\">User IDs: ${event.content.UserIDsaffected}</label>\r\n        <div class=\"form-group\">\r\n        <label if.bind=\"client.status==='01'\" class=\"col-md-6\">System: ${client.sid}</label>\r\n        <label if.bind=\"client.status==='01'\" class=\"col-md-6\">Client: ${client.sid}</label>\r\n        <label if.bind=\"client.status==='02'\" class=\"col-md-6\">Client not assigned</label>\r\n        <div class=\"topMargin\" if.bind=\"event.content.comments.length > 0\" innerhtml.bind=\"event.content.comments\"></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"form-group\">\r\n      <div class=\"hover_img\" repeat.for=\"file of event.files\">\r\n        <a href=\"${config.HELPTICKET_FILE_DOWNLOAD_URL}${helpTickets.selectedHelpTicket.referenceNo}/${file.fileName}\"\r\n           target=\"_blank\"\r\n           innerhtml.bind=\"file.fileName | fileType:helpTickets.selectedHelpTicket.referenceNo:'helpTickets'\"></a>\r\n      </div>\r\n    </div>\r\n\r\n    </div>\r\n</template>"; });
define('text!modules/tech/support/components/2-time.html', ['module'], function(module) { module.exports = "<template>\r\n  <div class=\"smart-timeline-icon bottomMarginLg\" innerhtml.bind=\"event.personId | gravatarUrlId:people.peopleArray:100:1\">\r\n\r\n  </div>\r\n  <div class=\"smart-timeline-time\">\r\n    <small>${event.dateEntered | dateFormat:'YYYY-MM-DD':true}</small>\r\n  </div>\r\n  <div class=\"smart-timeline-content borderTop leftJustify\">\r\n    <div class=\"form-group\">\r\n      <p>${event.personId | personName:people.peopleArray}</p>\r\n      <h4>User Ids: ${event.content.resetPasswordUserIDs}</h4>\r\n      <div class=\"form-group\">\r\n        <label if.bind=\"client.status==='01'\" class=\"col-md-6\">System: ${client.sid}</label>\r\n        <label if.bind=\"client.status==='01'\" class=\"col-md-6\">Client: ${client.sid}</label>\r\n        <label if.bind=\"client.status==='02'\" class=\"col-md-6\">Client not assigned</label>\r\n        <div class=\"topMargin\" if.bind=\"event.content.comment.length > 0\" innerhtml.bind=\"event.content.comment\"></div>\r\n      </div>\r\n      <div class=\"form-group\">\r\n        <div class=\"hover_img\" repeat.for=\"file of event.files\">\r\n          <a href=\"${config.HELPTICKET_FILE_DOWNLOAD_URL}${helpTickets.selectedHelpTicket.referenceNo}/${file.fileName}\"\r\n            target=\"_blank\"\r\n            innerhtml.bind=\"file.fileName | fileType:helpTickets.selectedHelpTicket.referenceNo:'helpTickets'\"></a>\r\n        </div>\r\n      </div>\r\n    </div>\r\n\r\n\r\n  </div>\r\n\r\n</template>\r\n"; });
define('text!modules/tech/support/components/3-time.html', ['module'], function(module) { module.exports = "<template>\r\n  <div class=\"smart-timeline-icon bottomMarginLg\" innerhtml.bind=\"event.personId | gravatarUrlId:people.peopleArray:100:1\">\r\n\r\n  </div>\r\n  <div class=\"smart-timeline-time\">\r\n    <small>${event.createdDate | dateFormat:'YYYY-MM-DD':true}</small>\r\n  </div>\r\n  <div class=\"smart-timeline-content borderTop leftJustify\">\r\n    <div class=\"form-group\">\r\n      <p>${event.personId | personName:people.peopleArray}</p>\r\n      <h4>Application: ${event.content.applicationId | productName:apps.appDownloadsArray}</h4>\r\n      <div class=\"row\">\r\n        <div class=\"col-lg-4\" show.bind=\"event.content.osWindows || event.content.osMac\">\r\n          <h4>Operating System</h4>\r\n          <label show.bind=\"event.content.osWindows\">Windows versions: ${event.content.windowsVersion}</label>\r\n          <label show.bind=\"event.content.osWindows32bit\">32-bit</label>\r\n          <label show.bind=\"event.content.osWindows64bit\">64-bit</label>\r\n          <label show.bind=\"event.content.osMac\">Mac versions: ${event.content.macVersion}</label>\r\n        </div>\r\n        <div class=\"col-lg-4\" show.bind=\"event.content.officeInvolved\">\r\n          <h4>Microsoft Office</h4>\r\n          <label show.bind=\"event.content.officeVersion\">Office versions: ${event.content.officeVersion}</label>\r\n        </div>\r\n        <div class=\"col-lg-4\" show.bind=\"event.content.wiredNetwork || event.content.wirelessNetwork || event.content.campusNetwork || event.content.personalNetwork\">\r\n          <h4>Network</h4>\r\n          <label show.bind=\"event.content.wiredNetwork\">Wired</label>\r\n          <label show.bind=\"event.content.wirelessNetwork\">Wireless</label>\r\n          <label show.bind=\"event.content.campusNetwork\">Campus</label>\r\n          <label show.bind=\"event.content.personalNetwork\">Personal/Private Network</label>\r\n        </div>\r\n      </div>\r\n      <div class=\"row\">\r\n        <div class=\"topMargin\" if.bind=\"event.content.comments.length > 0\" innerhtml.bind=\"event.content.comments\"></div>\r\n      </div>\r\n    </div>\r\n    <div class=\"form-group\">\r\n      <div class=\"hover_img\" repeat.for=\"file of event.files\">\r\n        <a href=\"${config.HELPTICKET_FILE_DOWNLOAD_URL}${helpTickets.selectedHelpTicket.referenceNo}/${file.fileName}\"\r\n           target=\"_blank\"\r\n           innerhtml.bind=\"file.fileName | fileType:helpTickets.selectedHelpTicket.referenceNo:'helpTickets'\"></a>\r\n      </div>\r\n    </div>\r\n   \r\n  </div>\r\n</template>"; });
define('text!modules/tech/support/components/4-time.html', ['module'], function(module) { module.exports = "<template>\r\n  <div class=\"smart-timeline-icon bottomMarginLg\" innerhtml.bind=\"event.personId | gravatarUrlId:people.peopleArray:100:1\">\r\n\r\n  </div>\r\n  <div class=\"smart-timeline-time\">\r\n    <small>${event.createdDate | dateFormat:'YYYY-MM-DD':true}</small>\r\n  </div>\r\n  <div class=\"smart-timeline-content borderTop leftJustify\">\r\n    <div class=\"form-group\">\r\n      <p>${event.personId | personName:people.peopleArray}</p>\r\n\r\n      <div if.bind=\"event.content.comments.length > 0\" innerhtml.bind=\"event.content.comments\"></div>\r\n    </div>\r\n    <div class=\"form-group\">\r\n      <div class=\"hover_img\" repeat.for=\"file of event.files\">\r\n        <a href=\"${config.HELPTICKET_FILE_DOWNLOAD_URL}${helpTickets.selectedHelpTicket.referenceNo}/${file.fileName}\"\r\n           target=\"_blank\"\r\n           innerhtml.bind=\"file.fileName | fileType:helpTickets.selectedHelpTicket.referenceNo:'helpTickets'\"></a>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</template>\r\n"; });
define('text!modules/tech/support/components/additiontalInfo.html', ['module'], function(module) { module.exports = "<template>\r\n    <div class=\"col-lg-12 topMargin\">\r\n        <!-- Help Panel -->\r\n        <compose  repeat.for=\"helpTicket of config.HELP_TICKET_TYPES\" \r\n            show.bind=\"helpTicket.show\"     \r\n            view=\"./help-ticket-${helpTicket.code}.html\"></compose>\r\n            \r\n        <!-- Additional Information Panel -->\r\n        <div show.bind=\"showAdditionalInfo\" class=\"col-md-12\" id=\"descriptionGroup\">\r\n            <div class=\"form-group\">\r\n            <label for=\"descriptionID\">Enter a description of the issue. Be as specific as possible and include steps that led up to the issue.</label>\r\n            <textarea id=\"descriptionID\" value.bind=\"helpTickets.selectedHelpTicketContent.content.comments\" class=\"form-control\" rows=\"12\"></textarea>\r\n            </div>\r\n\r\n            <div class=\"panel panel-default\">\r\n                <div class=\"input-group\">\r\n                    <span class=\"input-group-btn\">\r\n                        <span class=\"btn btn-primary btn-fill btn-wd btn-file\">\r\n                        Browse...<input change.delegate=\"changeFiles()\" id=\"uploadFiles\" files.bind=\"files\" type=\"file\" multiple=true>\r\n                        </span>\r\n                    </span>\r\n                    <input type=\"text\" value.bind=\"filesSelected\" class=\"form-control\" readonly/>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</template>"; });
define('text!modules/tech/support/components/Courses.html', ['module'], function(module) { module.exports = "<template>\r\n    <div class=\"topMargin\">\r\n        <table id=\"coursesTable\" class=\"table table-striped table-hover\">\r\n            <thead>\r\n                <tr>\r\n                    <td colspan='6'>\r\n                        <span click.delegate=\"refreshCourses()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Refresh\"><i class=\"fa fa-refresh\" aria-hidden=\"true\"></i></span>\r\n                        <span click.delegate=\"newCourse()\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"New Course\"><i class=\"fa fa-plus\" aria-hidden=\"true\"></i></span>\r\n                        <span click.delegate=\"editACourse()\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Edit Course\"><i class=\"fa fa-pencil\" aria-hidden=\"true\"></i></span>\r\n                        <span class=\"pull-right\" id=\"spinner\" innerhtml.bind=\"spinnerHTML\"></span>\r\n                    </td>\r\n                </tr>\r\n                <tr>\r\n                    <th style=\"width:20rem;\">Number </th>\r\n                    <th style=\"width:30rem;\">Name</th>\r\n                </tr>\r\n            </thead>\r\n            <tbody>\r\n                <tr id=\"sandBoxRow\" click.delegate=\"selectCourse(99)\">\r\n                    <td>${config.SANDBOX_NAME}</td>\r\n                    <td>${config.SANDBOX_NAME}</td>\r\n                </tr>\r\n                <tr id=\"selectCourse\" click.delegate=\"selectCourse($index, $event)\"  repeat.for=\"course of people.coursesArray\">\r\n                    <td data-title=\"number\">${course.number} </td>\r\n                    <td data-title=\"name\">${course.name}</td>\r\n                </tr>\r\n            </tbody>\r\n        </table>\r\n\r\n        <div class=\"row\" show.bind=\"courseSelected\">\r\n            <div class=\"panel panel-default col-md-12\">\r\n                <div class=\"panel-body\">\r\n                    <div class=\"form-group\">\r\n                        <input id=\"number\" value.bind=\"people.selectedCourse.number\" type=\"text\" placeholder=\"Course Number\"\r\n                            class=\"form-control\"/>\r\n                    </div>\r\n                    <div class=\"form-group\">\r\n                        <input id=\"name\" value.bind=\"people.selectedCourse.name\" type=\"text\" placeholder=\"Course Name\"\r\n                            class=\"form-control\"/>\r\n                    </div>\r\n                    <div class=\"row\">\r\n                        <div class=\"bottomMargin leftMargin rightMargin list-group-item\">\r\n                            <span click.delegate=\"saveCourse()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Save\"><i class=\"fa fa-floppy-o fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n                            <span click.delegate=\"cancelEditCourse()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Cancel\"><i class=\"fa fa-ban fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n                        </div> \r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</template>"; });
define('text!modules/tech/support/components/help-ticket-1.html', ['module'], function(module) { module.exports = "<template>\r\n    <div class=\" col-md-12\" id=\"curriculumHelp\">\r\n    <div class=\"form-group\">\r\n      <!--        <label for=\"curriculumTitle\">Enter the curriculum title</label> -->\r\n      <input type=\"text\" value.bind=\"helpTickets.selectedHelpTicketContent.content.curriculumTitle\" class=\"form-control \"\r\n             id=\"curriculumTitle\" placeholder=\"Curriculum Title\">\r\n    </div>\r\n    <div class=\"form-group\">\r\n      <!--         <label for=\"ExerciseModule\">Enter the specfic module</label> -->\r\n      <input type=\"text\" value.bind=\"helpTickets.selectedHelpTicketContent.content.ExerciseModule\" class=\"form-control \"\r\n             id=\"ExerciseModule\" placeholder=\"Exercise/Module\">\r\n    </div>\r\n    <div class=\"form-group\">\r\n      <!--        <label for=\"PageNumber\">Enter the page number</label> -->\r\n      <input type=\"text\" value.bind=\"helpTickets.selectedHelpTicketContent.content.PageNumber\" class=\"form-control \"\r\n             id=\"PageNumber\" placeholder=\"Page Number\">\r\n    </div>\r\n    <div class=\"form-group\">\r\n      <!--        <label for=\"UserIDsaffected\">Enter the user IDs affected</label> -->\r\n      <input type=\"text\" value.bind=\"helpTickets.selectedHelpTicketContent.content.UserIDsaffected\" class=\"form-control \"\r\n             id=\"UserIDsaffected\" placeholder=\"User IDs affected\">\r\n    </div>\r\n  </div>\r\n</template>"; });
define('text!modules/tech/support/components/help-ticket-2.html', ['module'], function(module) { module.exports = "<template>\r\n   <div class=\"col-lg-12\" id=\"resetPassword\">\r\n    <label for=\"resetPasswordUserIDs\">You can enter a range of user IDs or a list separated by commas.</label>\r\n    <input id=\"resetPasswordUserIDs\" value.bind=\"helpTickets.selectedHelpTicketContent.content.resetPasswordUserIDs\" type=\"text\" class=\"form-control\" placeholder=\"User IDs\">\r\n  </div>\r\n</template>"; });
define('text!modules/tech/support/components/help-ticket-3.html', ['module'], function(module) { module.exports = "<template>\r\n  <div class=\" col-md-12\" id=\"appHelp\">\r\n      <div class=\"row\">\r\n        <div class=\"topMargin\">\r\n          <label class=\"control-label\">Application</label>\r\n          <select value.bind=\"helpTickets.selectedHelpTicketContent.content.applicationId\" id=\"application\" class=\"form-control\">\r\n            <option value=\"\">Select an application</option>\r\n            <option repeat.for=\"app of apps.appDownloadsArray\" \r\n                    value.bind=\"app._id\">${app.name}</option>\r\n          </select>\r\n        </div>\r\n      </div>\r\n      <div show.bind=\"helpTickets.selectedHelpTicketContent.content.applicationId\" class=\"row topMargin\">\r\n         <label class=\"control-label\">Describe the Operating System</label>\r\n         <div class=\"panel panel-default\">\r\n          <div class=\"panel-body\">\r\n            <div class=\"row\">\r\n              <div class=\"col-lg-6\">\r\n                <div class=\"checkbox\">\r\n                  <label>\r\n                    <input checked.bind=\"helpTickets.selectedHelpTicketContent.content.osWindows\" type=\"checkbox\"> Windows\r\n                  </label>\r\n                  <input show.bind=\"helpTickets.selectedHelpTicketContent.content.osWindows\" value.bind=\"helpTickets.selectedHelpTicketContent.content.windowsVersion\" id=\"editDropDate\" class=\"form-control\" placeholder=\"Windows 8, 8.1, 10, etc.\" type=\"text\" />\r\n                  <div class=\"row\"  show.bind=\"helpTickets.selectedHelpTicketContent.content.osWindows\">\r\n                    <div class=\"checkbox col-lg-6\">\r\n                      <label class=\"checkbox-inline\">\r\n                        <input checked.bind=\"helpTickets.selectedHelpTicketContent.content.osWindows32bit\" type=\"checkbox\"> 32-bit\r\n                      </label>\r\n                      <label class=\"checkbox-inline\">\r\n                        <input checked.bind=\"helpTickets.selectedHelpTicketContent.content.osWindows64bit\" type=\"checkbox\"> 64-bit\r\n                      </label>\r\n                    </div>\r\n                </div>\r\n                </div>\r\n              </div>  \r\n              <div class=\"col-lg-6\">\r\n                <div class=\"checkbox\">\r\n                  <label>\r\n                    <input checked.bind=\"helpTickets.selectedHelpTicketContent.content.osMac\" type=\"checkbox\"> Mac OS\r\n                  </label>\r\n                  <input  show.bind=\"helpTickets.selectedHelpTicketContent.content.osMac\" value.bind=\"helpTickets.selectedHelpTicketContent.content.macVersion\" id=\"editDropDate\" class=\"form-control\" placeholder=\"Mac OS Versions\" type=\"text\" />\r\n                </div>\r\n              </div>\r\n            </div>\r\n              \r\n            </div>\r\n          </div>\r\n        </div>\r\n        \r\n        <div class=\"row\">\r\n          <div show.bind=\"helpTickets.selectedHelpTicketContent.content.applicationId\" class=\"topMargin col-lg-6\">\r\n            <label class=\"control-label\">Other Software Involved</label>\r\n              <div class=\"panel panel-default\">\r\n                <div class=\"panel-body\">\r\n                  <div class=\"row\">\r\n                    <div class=\"col-lg-6\">\r\n                      <div class=\"checkbox\">\r\n                        <label>\r\n                          <input checked.bind=\"helpTickets.selectedHelpTicketContent.content.officeInvolved\" type=\"checkbox\"> Is Microsoft Office involved?\r\n                        </label>\r\n                        <input show.bind=\"helpTickets.selectedHelpTicketContent.content.officeInvolved\"  value.bind=\"helpTickets.selectedHelpTicketContent.content.officeVersion\" id=\"editJoinDate\" class=\"form-control\" placeholder=\"2007, 2010, 2013, etc.\" type=\"text\" />\r\n                      </div>\r\n                  </div>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        \r\n          <div show.bind=\"helpTickets.selectedHelpTicketContent.content.applicationId\" class=\"topMargin col-lg-6\">\r\n            <label class=\"control-label\">Describe the Network Connection</label>\r\n            <div class=\"panel panel-default\">\r\n              <div class=\"panel-body\">\r\n                <div class=\"row\">\r\n                    <div class=\"checkbox col-lg-12\">\r\n                      <label class=\"checkbox-inline\">\r\n                        <input checked.bind=\"helpTickets.selectedHelpTicketContent.content.wiredNetwork\" type=\"checkbox\"> Wired\r\n                      </label>\r\n                      <label class=\"checkbox-inline\">\r\n                        <input checked.bind=\"helpTickets.selectedHelpTicketContent.content.wirelessNetwork\" type=\"checkbox\"> Wireless\r\n                      </label>\r\n                    </div>\r\n                  </div>\r\n                  <div class=\"row\">  \r\n                    <div class=\"checkbox col-lg-12\">\r\n                      <label class=\"checkbox-inline\">\r\n                        <input checked.bind=\"helpTickets.selectedHelpTicketContent.content.campusNetwork\" type=\"checkbox\"> Campus\r\n                      </label>\r\n                      <label class=\"checkbox-inline\">\r\n                        <input checked.bind=\"helpTickets.selectedHelpTicketContent.content.personalNetwork\" type=\"checkbox\"> Personal/Private Network\r\n                      </label>\r\n                    </div>\r\n                  </div>\r\n                </div>\r\n                  \r\n              </div>\r\n            </div>\r\n        </div>\r\n      \r\n  </div>\r\n</template>"; });
define('text!modules/tech/support/components/help-ticket-4.html', ['module'], function(module) { module.exports = "<template>\r\n\r\n</template>"; });
define('text!modules/tech/support/components/helpTicketDetails.html', ['module'], function(module) { module.exports = "<template>\r\n    <div class=\"bottomMargin list-group-item leftMargin rightMargin\">\r\n        <span click.delegate=\"save()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Save Response\"><i class=\"fa fa-floppy-o fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n        <span click.delegate=\"cancel()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Cancel\"><i class=\"fa fa-ban fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n    </div> \r\n    \r\n     <div class=\"col-lg-12 topMargin\">\r\n        <!-- Help Panel -->\r\n        <compose  repeat.for=\"helpTicket of config.HELP_TICKET_TYPES\" \r\n            show.bind=\"helpTicket.show\"     \r\n            view=\"./help-ticket-${helpTicket.code}.html\"></compose>\r\n            \r\n        <!-- Additional Information Panel -->\r\n        <div class=\"col-lg-12 topMargin\" id=\"descriptionGroup\">\r\n            <div class=\"form-group\">\r\n            <label for=\"descriptionID\">Enter a description of the issue. Be as specific as possible and include steps that led up to the issue.</label>\r\n            <textarea id=\"descriptionID\" value.bind=\"helpTickets.selectedHelpTicketContent.content.comments\" class=\"form-control\" rows=\"12\"></textarea>\r\n            </div>\r\n\r\n            <div class=\"panel panel-default\">\r\n                <div class=\"input-group\">\r\n                    <span class=\"input-group-btn\">\r\n                        <span class=\"btn btn-primary btn-fill btn-wd btn-file\">\r\n                        Browse...<input change.delegate=\"changeFiles()\" id=\"uploadFiles\" files.bind=\"files\" type=\"file\" multiple=true>\r\n                        </span>\r\n                    </span>\r\n                    <input type=\"text\" value.bind=\"filesSelected\" class=\"form-control\" readonly/>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</template>"; });
define('text!modules/tech/support/components/helpTicketType.html', ['module'], function(module) { module.exports = "<template>\r\n \r\n      <div class=\"form-group topMargin\" >\r\n        <select value.bind=\"editInstitution\" change.delegate=\"changeInstitution($event)\" id=\"institution\" class=\"form-control\">\r\n          <option value=\"\">Select an institution</option>\r\n          <option repeat.for=\"institution of selectedInstitutions\"\r\n                  value.bind=\"institution._id\">${institution.name}</option>\r\n        </select>\r\n      </div>\r\n\r\n      <!-- People Select -->\r\n      <div class=\"form-group\" show.bind=\"showPeople\">\r\n        <select value.bind=\"editPerson\" change.delegate=\"changePerson($event)\" id=\"person\" class=\"form-control\">\r\n          <option value=\"\">Select a person</option>\r\n          <option repeat.for=\"person of people.peopleArray\"\r\n                  value.bind=\"person._id\">${person._id | personName:people.peopleArray}</option>\r\n        </select>\r\n      </div>\r\n      \r\n     <div class=\"form-group\" show.bind=\"showSession\">\r\n        <select value.bind=\"helpTickets.selectedHelpTicket.sessionId\" change.delegate=\"sessionChanged($event)\" id=\"session\" class=\"form-control\">\r\n          <option value=\"\">Select a session</option>\r\n          <option repeat.for=\"session of sessions.sessionsArray\"\r\n                  value.bind=\"session._id\">Session ${session.session} - ${session.year}</option>\r\n        </select>\r\n      </div>\r\n\r\n      <!-- Type Select -->\r\n      <div show.bind=\"helpTickets.selectedHelpTicket.sessionId !== ''\" class=\"form-group\">\r\n        <select value.bind=\"helpTickets.selectedHelpTicket.helpTicketType\" change.delegate=\"typeChanged($event)\"\r\n                id=\"helpTicketPurpose\" class=\"form-control\">\r\n          <option value=\"-1\">Select the type of help ticket</option>\r\n          <option repeat.for=\"types of config.HELP_TICKET_TYPES\"\r\n                  value.bind=\"types.code\">${types.description}</option>\r\n        </select>\r\n      </div>\r\n\r\n      <div show.bind=\"config.HELP_TICKET_TYPES[helpTickets.selectedHelpTicket.helpTicketType - 1].message !== undefined\">\r\n        <div  class=\"well well-sm\" innerhtml.bind=\"config.HELP_TICKET_TYPES[helpTickets.selectedHelpTicket.helpTicketType - 1].message\" ></div>\r\n      </div>\r\n</template>"; });
define('text!modules/tech/support/components/Requests.html', ['module'], function(module) { module.exports = "<template>\r\n  <div>\r\n        <table id=\"clientTable\" class=\"table table-bordered table-responsive\" style=\"background:white;\">\r\n          <thead>\r\n          <tr class=\"header\">\r\n            <th>Product</th>\r\n            <th>System</th>\r\n            <th>Client</th>\r\n            <th>Status</th>\r\n          </tr>\r\n          </thead>\r\n          <tbody>\r\n            <tr id=\"${product.id}\" productId=\"${product.productId}\" \r\n                repeat.for=\"product of clientRequestsArray\"\r\n                click.trigger=\"requestChosen($event, product)\">\r\n              <td>${product.productId | productName:products.productsArray}</td>\r\n              <td>${product.systemId | lookupSid:systems.systemsArray}</td>\r\n              <td>${product.client}</td>\r\n              <td>${product.requestStatus | lookupDescription:config.REQUEST_STATUS}</td>\r\n            </tr>\r\n          </tbody>\r\n        </table>\r\n        <span id=\"client\"></span>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</template>"; });
define('text!modules/tech/support/components/selectProduct.html', ['module'], function(module) { module.exports = "<template>\r\n     <compose view='./Courses.html' show.bind=\"config.HELP_TICKET_TYPES[helpTickets.selectedHelpTicket.helpTicketType - 1].clientRequired\"></compose>\r\n\r\n      <!-- Product Select -->\r\n      <div show.bind=\"helpTickets.selectedHelpTicket.courseId !== '' && clientRequestsArray.length > 0\">\r\n        <table id=\"clientTable\" class=\"table table-bordered table-responsive\" style=\"background:white;\">\r\n          <thead>\r\n          <tr class=\"header\">\r\n            <th>Product</th>\r\n            <th>System</th>\r\n            <th>Client Number</th>\r\n            <th>Status</th>\r\n          </tr>\r\n          </thead>\r\n          <tbody>\r\n          <tr id=\"${product.id}\" productId=\"${product.productId}\" \r\n              repeat.for=\"product of clientRequestsArray[0].requestDetails\">\r\n            <td >${product.productId}</td>\r\n            <td>${product.sid | lookupSid:systems}</td>\r\n            <td>${product.client}</td>\r\n            <td>${product.status | lookupDescription:config.REQUEST_STATUS}</td>\r\n          </tr>\r\n          </tbody>\r\n        </table>\r\n        <span id=\"client\"></span>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</template>"; });
define('text!modules/tech/support/components/viewHTForm.html', ['module'], function(module) { module.exports = "<template>\r\n    <div class=\"col-lg-12\">\r\n      <div class=\"row\">\r\n        <h2>${viewHelpTicketsHeading}</h2>\r\n      </div>\r\n\r\n    <!-- Buttons -->\r\n    <div class=\"row\">\r\n      <div class=\"bottomMargin list-group-item\">\r\n          <span click.delegate=\"back()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Back\"><i class=\"fa fa-arrow-left fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n          <span click.delegate=\"respond()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Respond\"><i class=\"fa fa-paper-plane fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n          <span click.delegate=\"own()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Take Ownership\"><i class=\"fa fa-child fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n      </div> \r\n    </div>\r\n    \r\n    <!-- Help Ticket Header -->\r\n    <div class=\"topMargin\">\r\n        <!-- Enter Response -->\r\n        <div show.bind=\"enterResponse\" class=\"topMargin bottomMargin\">\r\n\r\n          <div class=\"col-md-12 topMargin\">\r\n            <span click.delegate=\"saveResponse()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Save Response\"><i class=\"fa fa-floppy-o fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n            <span click.delegate=\"cancelResponse()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Cancel\"><i class=\"fa fa-ban fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n          </div>\r\n\r\n          <div class=\"col-md-12 topMargin\">\r\n            <div class=\"row\">\r\n              <textarea value.bind=\"helpTickets.selectedHelpTicketContent.content.comments\" class=\"form-control\" rows=\"10\"></textarea>\r\n            </div>\r\n            <div class=\"row\">\r\n               <div class=\"col-lg-2\">\r\n                  <div class=\"checkbox \">\r\n                    <label>\r\n                      <input checked.bind=\"helpTickets.selectedHelpTicketContent.confidential\" type=\"checkbox\"> Confidential\r\n                    </label>\r\n                  </div>\r\n                </div>\r\n                <div class=\"col-lg-2\">\r\n                  <div class=\"checkbox\">\r\n                    <label>\r\n                      <input change.bind=\"checkSendMail()\" checked.bind=\"sendEmail\" type=\"checkbox\"> Send Email\r\n                    </label>\r\n                  </div>\r\n                </div>\r\n            </div>\r\n          </div>\r\n\r\n          <div class=\"topMargin\">\r\n            <div class=\"input-group\">\r\n              <span class=\"input-group-btn\">\r\n                <span class=\"btn btn-primary btn-file topMargin bottomMargin\">\r\n                  Browse...<input change.delegate=\"changeFiles()\" id=\"uploadFiles\" files.bind=\"files\" type=\"file\" multiple=true>\r\n                </span>\r\n              </span>\r\n              <input type=\"text\" value.bind=\"filesSelected\" class=\"form-control topMargin bottomMargin\" readonly/>\r\n            </div>\r\n          </div>\r\n\r\n        </div>\r\n\r\n        <!-- widget content -->\r\n        <div class=\"row\">\r\n          <div class=\"panel panel-default col-md-12\">\r\n            \r\n            <div class=\"panel-body\">\r\n              <div class=\"row\">\r\n                <div class=\"col-md-6\">\r\n                  <div class=\"form-group\">\r\n                    <h3 class=\"col-md-offset-1\">Created: ${helpTickets.selectedHelpTicket.createdDate | dateFormat:'YYYY-MM-DD'} ${helpTickets.selectedHelpTicket.createdDate | dateFormat:'h:mm A'}</h3>\r\n                  </div>\r\n                </div>\r\n                <div class=\"col-md-6\">\r\n                  <div class=\"form-group col-md-10\">\r\n                    <h3>Type: ${helpTickets.selectedHelpTicket.helpTicketType | lookupDescription:config.HELP_TICKET_TYPES}</h3>\r\n                  </div>\r\n                </div>\r\n              </div>\r\n              <div class=\"row\">\r\n                <div class=\"col-md-6\">\r\n                  <div class=\"form-group\">\r\n                    <h3 class=\"col-md-offset-1\">Session: ${helpTickets.selectedHelpTicket.sessionId | session:sessions.sessionsArray}</h3>\r\n                  </div>\r\n                </div>\r\n                <div class=\"col-md-6\">\r\n                <div class=\"form-group col-md-10\">\r\n                  <h3>Status: ${helpTickets.selectedHelpTicket.helpTicketStatus | lookupDescription:config.HELP_TICKET_STATUSES}</h3>\r\n                </div>\r\n                </div>\r\n              </div>\r\n              <div class=\"row\">\r\n                <div class=\"col-md-6\">\r\n                  <div class=\"form-group\">\r\n                    <label class=\"col-md-offset-1\" id=\"owner\">Owner: ${helpTickets.selectedHelpTicket.owner[0].personId | person:people.peopleArray:'fullName'}</label>\r\n                  </div>\r\n                </div>\r\n                <div class=\"col-md-6\">\r\n                  <div class=\"form-group col-md-10\">\r\n                    <label>Keywords: ${helpTickets.selectedHelpTicket.keyWords}</label>\r\n                  </div>\r\n                </div>\r\n              </div>\r\n                <div class=\"form-group col-lg-6\">\r\n                  <div class=\"input-group\">\r\n                    <span class=\"input-group-btn\">\r\n                        <button class=\"btn btn-primary btn-file btn-fill\" placeholder=\"Change status\"\r\n                                click.delegate=\"updateStatus()\" type=\"button\">Save Status</button>\r\n                    </span>\r\n                    <select id=\"helpTicketStatus\" value.bind=\"helpTickets.selectedHelpTicket.helpTicketStatus\" class=\"form-control\">\r\n                      <option repeat.for=\"status of config.HELP_TICKET_STATUSES\" value=${status.code}>${status.description}</option>\r\n                    </select>\r\n                  </div>\r\n                </div>\r\n\r\n                <!-- Add keywords -->\r\n                <div class=\"form-group col-lg-6\">\r\n                  <div class=\"input-group\">\r\n                    <span class=\"input-group-btn\">\r\n                      <button class=\"btn btn-primary btn-fill\" placeholder=\"Enter keywords\"\r\n                              click.delegate=\"updateKeywords()\" type=\"button\">Save Keywords</button>\r\n                    </span>\r\n                    <input type=\"text\" value.bind=\"helpTickets.selectedHelpTicket.keyWords\" class=\"form-control\">\r\n                  </div>\r\n                </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n        <div class=\"well well-sm topMargin\">\r\n          <!-- Timeline Content -->\r\n          <div class=\"smart-timeline\">\r\n            <ul class=\"smart-timeline-list\">\r\n              <li  repeat.for=\"event of helpTickets.selectedHelpTicket.content | sortDateTime:'createdDate':'DESC':1:isUCC\">\r\n                <compose view=\"./${event.type}-time.html\"></compose>\r\n              </li>\r\n            </ul>\r\n          </div>\r\n        </div>\r\n    </div>\r\n</template>"; });
define('text!modules/tech/support/components/viewHTTable.html', ['module'], function(module) { module.exports = "<template>\r\n    <div class=\"col-lg-12 col-sm-12\">\r\n        <div class='row'>\r\n            <div class='col-lg-10 col-lg-offset-1 bottomMargin'>\r\n                <table id=\"helpTicketTable\" class=\"table table-striped table-hover\">\r\n                    <thead>\r\n                        <tr>\r\n                            <td colspan='6'>\r\n                                <compose view=\"../../../../resources/elements/table-navigation-bar.html\"></compose>\r\n                            </td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td colspan='6'>\r\n                                <span click.delegate=\"refresh()\" class=\"smallMarginRight\"><i class=\"fa fa-refresh\" aria-hidden=\"true\"></i></span>\r\n                                <span class=\"pull-right\" id=\"spinner\" innerhtml.bind=\"spinnerHTML\"></span>\r\n                            </td>\r\n                        </tr>\r\n                  <tr>\r\n                    <th></th>\r\n                    <th class=\"hasinput\">\r\n                      <select change.delegate=\"dataTable.filterList($event)\" class=\"form-control\" id=\"helpTicketType\">\r\n                        <option value=\"\"></option>\r\n                        <option repeat.for=\"type of config.HELP_TICKET_TYPES\"\r\n                                value.bind=\"type.code\">${type.description}</option>\r\n                      </select>\r\n                    </th>\r\n                    <th class=\"hasinput\">\r\n                      <select value.bind=\"selectedStatus\" change.delegate=\"dataTable.filterList($event)\" class=\"form-control\" id=\"helpTicketStatus\">\r\n                        <option value=\"\"></option>\r\n                        <option repeat.for=\"status of config.HELP_TICKET_STATUSES\"\r\n                                value.bind=\"status.code\">${status.description}</option>\r\n                      </select>\r\n                    </th>\r\n                    <th class=\"hasinput\">\r\n                      <input change.delegate=\"dataTable.filterList($event)\" id=\"createdDate\" type=\"date\" placeholder=\"Filter Date\" class=\"form-control datepicker\" data-dateformat=\"yy/mm/dd\">\r\n                    </th>\r\n                    <th></th>\r\n                  </tr>\r\n                  <tr>\r\n                    <th>\r\n                      Number <span click.trigger=\"dataTable.sortArray('helpTicketNo')\"><i class=\"fa fa-sort\"></i></span>\r\n                    </th>\r\n                    <th>\r\n                      Type <span click.trigger=\"dataTable.sortArray('helpTicketType')\"><i class=\"fa fa-sort\"></i></span><br>\r\n                    </th>\r\n                    <th>\r\n                      Status <span click.trigger=\"dataTable.sortArray('status')\"><i class=\"fa fa-sort\"></i></span><br>\r\n                    </th>\r\n                    <th>\r\n                      Date Created <span click.trigger=\"dataTable.sortArray('dateCreated')\"><i class=\"fa fa-sort\"></i></span>\r\n                    </th>\r\n                    <th>Customer</th>\r\n                  </tr>\r\n                  </thead>\r\n                  <tbody>\r\n                  <tr repeat.for=\"helpTicket of displayArray  | pageFilter:dataTable.startRecord:dataTable.take\" click.delegate=\"selectHelpTicket($event, $index)\">\r\n                    <td data-title=\"referenceNo\">${helpTicket.helpTicketNo}</td>\r\n                    <td data-title=\"type\">${helpTicket.helpTicketType | lookupDescription:config.HELP_TICKET_TYPES}</td>\r\n                    <td data-title=\"status\">${helpTicket.helpTicketStatus | lookupDescription:config.HELP_TICKET_STATUSES}</td>\r\n                    <td data-title=\"createdDate\">${helpTicket.createdDate | dateFormat:config.DATE_FORMAT_TABLE:true}</td>\r\n                    <td data-title=\"personId\">${helpTicket.personId | personName:people.peopleArray}\r\n                  </tr>\r\n                  </tbody>\r\n                </table>\r\n            </div>\r\n            <div class=\"row\" show.bind=\"helpTicketSelected\">\r\n              <compose view=\"./viewHTForm.html\"></compose>\r\n            </div>\r\n          </div>\r\n      </div>\r\n    </div>\r\n</template>"; });
define('text!modules/user/requests/components/client-request-step1.html', ['module'], function(module) { module.exports = "<template>\r\n  <!-- Term Select -->\r\n  <div class=\"row\">\r\n    <div class=\"col-sm-12\">\r\n      <div class=\"form-group leftJustify\">\r\n        <select value.bind=\"sessionId\" class=\"form-control\" change.delegate=\"changeSession($event)\" id=\"session\">\r\n          <option value=\"-1\">Select a session</option>\r\n          <option repeat.for=\"session of sessions.sessionsArray\"\r\n                  value.bind=\"session._id\">Session ${session.session} - ${session.year}</option>\r\n        </select>\r\n      </div>\r\n    </div>\r\n  </div>\r\n\r\n\r\n  <div class=\"row\">\r\n    <div show.bind=\"sessionSelected\" class=\"col-sm-12\">\r\n      <div class=\"form-group\">\r\n        <select value.bind=\"requestType\" change.delegate=\"changeRequestType($event)\" id=\"requestType\" class=\"form-control\">\r\n          <option value=\"-1\">Choose the Type of The Request</option>\r\n           <option value=\"sandboxCourse\">${config.SANDBOX_NAME}</option>\r\n           <option value=\"regularCourse\">Regular Course</option>\r\n        </select>\r\n      </div>\r\n    </div>\r\n  </div>\r\n\r\n  <compose show.bind=\"regularClient && sessionSelected\" view='./Courses.html'></compose>\r\n\r\n  <!-- Number of students -->\r\n  <div class=\"row\"  id=\"numStudents\" show.bind=\"courseSelected\">\r\n    <div class=\"col-sm-6\">\r\n      <div class=\"form-group topMargin\">\r\n        <div class=\"input-group  col-md-9\">\r\n          <div >\r\n            <label for=\"undergraduates\" class=\"leftJustify\">Number of Undergraduates</label>\r\n            <input readonly.bind=\"existingRequest\" id=\"undergraduates\"  type=\"number\" placeholder=\"Number of Undergraduates\"\r\n                   class=\"form-control\" value.bind=\"requests.selectedRequest.undergradIds\" style=\"width:343px;\"/>\r\n            <label show.bind=\"requests.selectedRequest.addUndergraduates > 0\">Additional id's requested: ${requests.selectedRequest.addUndergraduates}</label>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <div class=\"col-sm-6\">\r\n      <div class=\"form-group topMargin\">\r\n        <div class=\"input-group col-md-9\">\r\n          <div  class=\"form-group\">\r\n            <label for=\"graduates\" class=\"leftJustify\">Number of Graduates</label>\r\n            <input readonly.bind=\"existingRequest\" id=\"graduates\" type=\"number\" placeholder=\"Number of Graduates\"\r\n                   class=\"form-control\" value.bind=\"requests.selectedRequest.graduateIds\" style=\"width:343px;\"/>\r\n            <label show.bind=\"requests.selectedRequest.addGraduates > 0\">Additional id's requested: ${requests.selectedRequest.addGraduates}</label>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n\r\n  <!-- Begin and End Date -->\r\n  <div class=\"row\" show.bind=\"sandBoxClient || courseSelected\">\r\n      <div class=\"col-sm-6\">\r\n        <div class=\"form-group topMargin\">\r\n          <div class=\"input-group\">\r\n            <div>\r\n              <label for=\"beginDate\" class=\"leftJustify\">Date the course begins</label>\r\n              <input readonly.bind=\"existingRequest\" change.trigger=\"changeBeginDate()\" type=\"date\" value.bind=\"requests.selectedRequest.startDate\"\r\n                     class=\"form-control\" id=\"beginDate\" min.bind=\"minStartDate\" max.bind=\"maxStartDate\">\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n      <div class=\"col-sm-6\">\r\n        <div class=\"form-group topMargin\">\r\n          <div class=\"input-group\">\r\n            <div>\r\n              <label for=\"endDate\" class=\"leftJustify\">Date the course ends</label>\r\n              <input readonly.bind=\"existingRequest\" change.trigger=\"changeEndDate()\" type=\"date\" value.bind=\"requests.selectedRequest.endDate\"\r\n                     max.bind=\"maxEndDate\" min.bind=\"minEndDate\" class=\"form-control\" id=\"endDate\">\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n\r\n</template>\r\n"; });
define('text!modules/user/requests/components/client-request-step2.html', ['module'], function(module) { module.exports = "<template>\r\n  <div class=\"row\">\r\n    <div class=\"col-md-12\"  >\r\n      <div  class=\"well well-sm col-md-10 col-sm-offset-1\">${siteInfo.selectMessageByKey('SELECT_PRODUCT_WELL').content}</div>\r\n    </div>\r\n    <span class=\"leftMargin\" id=\"productList\"></span>\r\n    <div class=\"col-md-12\" >\r\n      <div class=\"col-md-5 topMargin\">\r\n        <label>Available Products</label>\r\n        <div class=\"well well2 overFlow\" style=\"height:400px;\">\r\n          <input class=\"form-control\" value.bind=\"filter\" input.trigger=\"filterList()\" placeholder=\"Filter products\"/>\r\n          <ul class=\"list-group\">\r\n            <button click.trigger=\"selectProduct($event)\" type=\"button\" repeat.for=\"product of filteredProductsArray\" id=\"${product._id}\"\r\n                    class=\"list-group-item\">${product.name}</button>\r\n          </ul>\r\n        </div>\r\n      </div>\r\n      <div class=\"col-md-5 col-md-offset-1 topMargin\">\r\n        <label id=\"requestProductsLabel\">Requested Products</label>\r\n        <div class=\"well well2 overflow\" style=\"height:400px;\">\r\n          <ul class=\"list-group\">\r\n            <button  click.trigger=\"removeProduct($event)\" type=\"button\" repeat.for=\"product of requests.selectedRequest.requestDetails\" id=\"${product.productId}\"\r\n                    class=\"list-group-item\">${product.productId | productName:products.productsArray}</button>\r\n          </ul>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</template>\r\n"; });
define('text!modules/user/requests/components/client-request-step3.html', ['module'], function(module) { module.exports = "<template>\r\n  <div class=\"row\">\r\n    <div class=\"col-md-12\">\r\n      <div  class=\"well well-sm col-md-10 col-sm-offset-1\">${siteInfo.selectMessageByKey('CLIENT_REQUESTS_COMMENTS').content}</div>\r\n    </div>\r\n    <div class=\"form-group col-md-12\">\r\n      <textarea readonly.bind=\"existingRequest\" placeholder=\"Additional Comments\" class=\"col-md-12 topMargin\" id=\"comments\"\r\n                value.bind=\"requests.selectedRequest.comments\" class=\"form-control\" rows=\"10\"></textarea>\r\n    </div>\r\n  </div>\r\n</template>"; });
define('text!modules/user/requests/components/client-request-step4.html', ['module'], function(module) { module.exports = "<template>\r\n\r\n  <div class=\"col-md-12\" >\r\n    <div  class=\"well well-sm col-md-10 col-sm-offset-1\" innerhtml.bind=\"siteInfo.selectMessageByKey('CLIENT_REQUESTS_SUMMARY').content\"></div>\r\n  </div>\r\n  <div class=\"form-group col-md-12\">\r\n    <div class=\"row\">\r\n      <h4 show.bind=\"requests.selectedRequest.courseId != config.SANDBOX_ID\" class=\"col-md-5 topMargin\">Course: <b>${requests.selectedRequest.courseId | courseName:people.coursesArray}</b></h4>\r\n      <h4 show.bind=\"requests.selectedRequest.courseId == config.SANDBOX_ID\" class=\"col-md-5 topMargin\">Course: <b>Faculty Development</b></h4>\r\n    </div>\r\n    <div class=\"row\">\r\n      <h4 class=\"col-md-5 topMargin\" show.bind=\"requests.selectedRequest.courseId != config.SANDBOX_ID\">Undergraduates: <b>${requests.selectedRequest.undergradIds}</b></h4>\r\n      <h4 class=\"col-md-5 topMargin\" show.bind=\"requests.selectedRequest.courseId != config.SANDBOX_ID\">Graduates: <b>${requests.selectedRequest.graduateIds}</b> </h4>\r\n    </div>\r\n    <div class=\"row\">\r\n      <h4 class=\"col-md-5 topMargin\">Course Begins: <b>${requests.selectedRequest.startDate}</b></h4>\r\n      <h4 class=\"col-md-5 topMargin\">Course Ends: <b>${requests.selectedRequest.endDate}</b></h4>\r\n    </div>\r\n    <div class=\"col-md-12\"></div>\r\n    <div class=\"row\" id=\"productListTable\">\r\n      <table class=\"table table-striped table-bordered col-md-10 topMargin\">\r\n        <thead>\r\n        <tr>\r\n          <th>Requested Product</th>\r\n          <th>Date Required</th>\r\n        </tr>\r\n        <tbody>\r\n        <tr repeat.for=\"request of requests.selectedRequest.requestDetails\">\r\n          <td>${request.productId | productName:products.productsArray}</td>\r\n          <td>\r\n            <div class=\"form-group  col-md-8\">\r\n              <input readonly.bind=\"request._id\" type=\"date\" min.bind=\"minRequiredDate\" max.bind=\"maxRequiredDate\" value.bind=\"request.requiredDate\"\r\n                     class=\"form-control requiredDates\" id=\"requiredDate-${$index}\">\r\n            </div>\r\n          </td>\r\n        </tr>\r\n        </tbody>\r\n      </table>\r\n    </div>\r\n\r\n    <div class=\"row\">\r\n      <div class=\"col-sm-12\">\r\n        <div class=\"form-group\" show.bind=\"comments !== ''\">\r\n          <label >Comments:</label>\r\n          <div class=\"textareaDiv topMargin\" style=\"height:100px;\" innerhtml.bind=\"requests.selectedRequest.comments\"></div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n\r\n  </div>\r\n</template>\r\n"; });
define('text!modules/user/requests/components/Courses.html', ['module'], function(module) { module.exports = "<template>\r\n    <div class=\"topMargin\">\r\n        <table id=\"coursesTable\" class=\"table table-striped table-hover\">\r\n            <thead>\r\n                <tr>\r\n                    <td colspan='6'>\r\n                        <span click.delegate=\"refreshCourses()\" class=\"smallMarginRight\"><i class=\"fa fa-refresh\" aria-hidden=\"true\"></i></span>\r\n                        <span click.delegate=\"newCourse()\"><i class=\"fa fa-plus\" aria-hidden=\"true\"></i></span>\r\n                        <span style=\"margin-left:5px;\" click.delegate=\"editACourse()\"><i class=\"fa fa-pencil\" aria-hidden=\"true\"></i></span>\r\n                        <span class=\"pull-right\" id=\"spinner\" innerhtml.bind=\"spinnerHTML\"></span>\r\n                    </td>\r\n                </tr>\r\n                <tr>\r\n                    <th style=\"width:20rem;\">Number </th>\r\n                    <th style=\"width:30rem;\">Name</th>\r\n                    <th style=\"width:15rem;\">Status</th>\r\n                </tr>\r\n            </thead>\r\n            <tbody>\r\n                <tr id=\"selectCourse\" click.delegate=\"selectCourse($index, $event)\"  repeat.for=\"course of people.coursesArray\">\r\n                    <td data-title=\"nummber\">${course.number} </td>\r\n                    <td data-title=\"name\">${course.name}</td>\r\n                    <td data-tile=\"active\">${course.active | translateStatus}</td>\r\n                </tr>\r\n            </tbody>\r\n        </table>\r\n\r\n        <div class=\"row\" show.bind=\"editCourse\">\r\n            <div class=\"panel panel-default col-md-12\">\r\n                <div class=\"panel-body\">\r\n                    <div class=\"form-group\">\r\n                        <input id=\"number\" value.bind=\"people.selectedCourse.number\" type=\"text\" placeholder=\"Course Number\"\r\n                            class=\"form-control\"/>\r\n                    </div>\r\n                    <div class=\"form-group\">\r\n                        <input id=\"name\" value.bind=\"people.selectedCourse.name\" type=\"text\" placeholder=\"Course Name\"\r\n                            class=\"form-control\"/>\r\n                    </div>\r\n                    <div class=\"form-group\">\r\n                        <div class=\"checkbox\">\r\n                            <label class=\"pull-left\">\r\n                                <input id=\"activeProduct\" checked.bind=\"people.selectedCourse.active\" type=\"checkbox\"> Active\r\n                            </label>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n                <div class=\"bottomMargin\">\r\n                    <button type=\"button\" class=\"btn btn-primary\" click.trigger=\"cancelEditCourse()\">Cancel</button>\r\n                    <button click.trigger=\"saveCourse()\" type=\"button\" class=\"btn btn-primary\">Save</button>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</template>\r\n"; });
define('text!modules/user/requests/components/requestDetailDetails.html', ['module'], function(module) { module.exports = "<template>\r\n    <div class=\"col-lg-5\" show.bind=\"showRequest\">\r\n      <div class=\"panel panel-primary topMargin\">\r\n        <div class=\"panel-heading\">\r\n          <h3 class=\"panel-title\">${products.selectedProduct.name}</h3>\r\n        </div>\r\n        <div class=\"panel-body\">        \r\n          <div show.bind=\"requests.selectedRequestDetail.requestStatus == config.ASSIGNED_REQUEST_CODE\">\r\n          <table class=\"table table-striped table-hover\">\r\n            <thead>\r\n              <tr>\r\n                <th>System</th>\r\n                <th>Client</th>\r\n                <th>Student IDs</th>\r\n                <th>Student Password</th>\r\n              </tr>\r\n            </thead>\r\n            <tbody>\r\n              <tr repeat.for=\"assign of requests.selectedRequestDetail.assignments\" click.trigger=\"selectAssignment(assign, $index)\">\r\n                <td>${assign.systemId | lookupSid:systems.systemsArray}</td>\r\n                <td>${assign.client}</td>\r\n                <td>${assign.studentUserIds}</td>\r\n                <td>${assign.studentPassword}</td>\r\n              </tr>\r\n            </tbody>\r\n          </table>\r\n          <h4 class=\"topMargin\"><strong>Faculty IDs</strong></h4>\r\n          <div class=\"form-group\">\r\n            <h5 class=\"panel-title\">Faculty IDs: ${requests.selectedRequestDetail.assignments[selectedAssignmentIndex].facultyUserIds}</h3>\r\n          </div>\r\n          <div class=\"form-group\">\r\n            <h5 class=\"panel-title\">Faculty Password: ${requests.selectedRequestDetail.assignments[selectedAssignmentIndex].facultyPassword}</h5>\r\n          </div>\r\n          <h4 class=\"topMargin\"><strong>System Details</strong></h4>\r\n          <div class=\"form-group\">\r\n            <h5 class=\"panel-title\">SID: ${systems.selectedSystem.sid}</h3>\r\n          </div>\r\n          <div class=\"form-group\">\r\n            <h5 class=\"panel-title\">Server: ${systems.selectedSystem.server}</h3>\r\n          </div>\r\n          <div class=\"form-group\">\r\n            <h5 class=\"panel-title\">System Number: ${systems.selectedSystem.instance}</h3>\r\n          </div>\r\n          <div class=\"form-group\">\r\n            <h5 class=\"panel-title\">ITS: ${systems.selectedSystem.its}</h3>\r\n          </div>\r\n          <div class=\"col-lg-12 topMargin\" innerhtml.bind=\"requests.selectedRequestDetail.techComments\"></div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <div show.bind=\"products.selectedProduct.productInfo\" class=\"panel panel-primary topMargin\">\r\n      <div class=\"panel-heading\">Product Information</div>\r\n      <div class=\"panel-body\" innerhtml.bind=\"products.selectedProduct.productInfo\"></div>\r\n    </div>\r\n  </div>\r\n</template>\r\n"; });
define('text!modules/user/requests/components/requestDetails.html', ['module'], function(module) { module.exports = "<template>\r\n     <div class=\"row\">\r\n        <div class=\"col-lg-12\">\r\n          <div  class=\"panel panel-default topMargin\">\r\n            <div class=\"panel-body leftJustify\">\r\n              <div class=\"bottomMargin list-group-item\">\r\n                <span click.delegate=\"save()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Save\"><i class=\"fa fa-floppy-o fa-2x fa-border\" aria-hidden=\"true\" ></i></span>\r\n                <span click.delegate=\"cancel()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" data-title=\"Cancel\" title=\"Cancel\"><i class=\"fa fa-ban fa-2x fa-border\" aria-hidden=\"true\"></i></span>\r\n              </div>\r\n              <div class=\"form-group bottomMargin\" show.bind =\"requests.selectedRequestDetail.requestStatus == config.CUSTOMER_ACTION_REQUEST_CODE\" >\r\n                <label for=\"message\" class=\"control-label\">The UCC staff has asked you to provide additional information</label>\r\n                <textarea  readonly class=\"col-lg-12\" id=\"message\" innerhtml.bind=\"requests.selectedRequestDetail.customerMessage\" class=\"form-control\" rows=\"10\"></textarea>\r\n                <h5>Enter your response in the comments box below and click save</h5>\r\n              </div>\r\n              <div class=\"form-group\" show.bind=\"requests.selectedRequest.courseId != config.SANDBOX_ID\">\r\n                 \r\n                  <div class=\"row\">\r\n                    <div class=\"col-lg-4\">\r\n                        <div class=\"form-group\">\r\n                            <label for=\"editAddUnder\" class=\"control-label\">Undergraduates</label>\r\n                            <input value.bind=\"requests.selectedRequest.undergradIds\" id=\"editAddUnder\" class=\"form-control input-sm\" placeholder=\"Undergraduates\" type=\"number\" />\r\n                        </div>\r\n                    </div>\r\n                              \r\n                    <div class=\"col-lg-4 col-lg-offset-2\">\r\n                        <div class=\"form-group\">\r\n                            <label for=\"editAddGrad\" class=\"control-label\">Graduates</label>\r\n                             <input value.bind=\"requests.selectedRequest.graduateIds\" type=\"number\" id=\"editAddGrad\" class=\"form-control input-sm\" placeholder=\"Graduates\"/>\r\n                        </div>\r\n                    </div>\r\n                  </div>\r\n                \r\n                \r\n              </div>\r\n              <div class=\"leftJustify\">\r\n                <div class=\"row\">\r\n                  <div class=\"col-lg-6\">\r\n                    <div class=\"form-group topMargin\">\r\n                      <div class=\"input-group\">\r\n                        <div>\r\n                          <label for=\"beginDate\" class=\"leftJustify\">Date the course begins</label>\r\n                          <input change.trigger=\"changeBeginDate()\" type=\"date\" value.bind=\"requests.selectedRequest.startDate\"\r\n                                class=\"form-control\" id=\"beginDate\">\r\n                        </div>\r\n                      </div>\r\n                    </div>\r\n                  </div>\r\n                  <div class=\"col-lg-6\">\r\n                    <div class=\"form-group topMargin\">\r\n                      <div class=\"input-group\">\r\n                        <div>\r\n                          <label for=\"endDate\" class=\"leftJustify\">Date the course ends</label>\r\n                          <input change.trigger=\"changeEndDate()\" type=\"date\" value.bind=\"requests.selectedRequest.endDate\"\r\n                                class=\"form-control\" id=\"endDate\">\r\n                        </div>\r\n                      </div>\r\n                    </div>\r\n                  </div>\r\n                </div>\r\n                \r\n              </div>\r\n               <textarea  placeholder=\"Additional Comments\" class=\"topMargin col-lg-12\" id=\"comments\"\r\n                value.bind=\"requests.selectedRequest.comments\" class=\"form-control\" rows=\"10\"></textarea>\r\n              \r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n</template>\r\n    "; });
define('text!modules/user/requests/components/requestsTable.html', ['module'], function(module) { module.exports = "<template>\r\n     <div class='row'>\r\n            <div class='col-lg-12'>\r\n                <table id=\"requestsTable\" class=\"table table-striped table-hover\">\r\n                    <thead>\r\n                        \r\n                        <tr>\r\n                            <td colspan=\"6\">\r\n                                <span click.delegate=\"refresh()\" class=\"smallMarginRight\"><i class=\"fa fa-refresh\" aria-hidden=\"true\"></i></span>\r\n                                <span class=\"pull-right\" id=\"spinner\" innerhtml.bind=\"spinnerHTML\"></span>\r\n                            </td>\r\n                        </tr>\r\n                        <tr>\r\n                          <th>Product</th>\r\n                          <th>Status</th>\r\n                          <th>Date Created</th>\r\n                          <th>Date Required</th>\r\n                        </tr>\r\n                  </thead>\r\n                  <tbody>\r\n                    <tr  click.delegate=\"edit(product, $event, $index)\" repeat.for=\"product of displayArray | pageFilter:dataTable.startRecord:dataTable.take\">\r\n                      <td data-title=\"Product\">${product.productId | productName:products.productsArray}</td>\r\n                      <td data-title=\"Status\">${product.requestStatus | lookupDescription:config.REQUEST_STATUS}</td>\r\n                      <td data-title=\"createdDate\">${product.createdDate | dateFormat:config.DATE_FORMAT_TABLE}</td>\r\n                      <td data-title=\"createdDate\">${product.requiredDate | dateFormat:config.DATE_FORMAT_TABLE}</td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n          </div>\r\n        </div>\r\n</template>"; });
define('text!modules/user/requests/components/viewRequestsForm.html', ['module'], function(module) { module.exports = "<template>\r\n</template>"; });
define('text!modules/user/requests/components/viewRequestsTable.html', ['module'], function(module) { module.exports = "<template>\r\n  <div class=\"row\">\r\n    <div class=\"col-lg-7\">\r\n      \r\n      <!-- Session Select -->\r\n      <div class=\"row\">\r\n        <div class=\"form-group topMargin col-lg-5\">\r\n            <select value.bind=\"selectedSession\" change.delegate=\"getRequests()\" id=\"session\" class=\"form-control\">\r\n              <option value=\"\">Select a session</option>\r\n              <option repeat.for=\"session of sessions.sessionsArray\"\r\n                      value.bind=\"session._id\">Session ${session.session} - ${session.year}</option>\r\n            </select>\r\n        </div>\r\n      \r\n    \r\n        <!-- Course Select -->\r\n        <div show.bind=\"selectedSession != ''\">\r\n          <div class=\"form-group topMargin col-lg-5\">\r\n            <select value.bind=\"selectedCourse\" change.delegate=\"getRequests()\" id=\"course\"\r\n                    class=\"form-control\">\r\n              <option value=\"\">Select a course</option>\r\n              <option value.bind=\"config.SANDBOX_ID\">${config.SANDBOX_NAME}</option>\r\n              <option repeat.for=\"course of people.coursesArray\"\r\n                      value.bind=\"course._id\">${course.number} - ${course.name}</option>\r\n            </select>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    \r\n      <div show.bind=\"displayArray.length > 0\">\r\n        <!-- Request Table -->\r\n        <compose view=\"./requestsTable.html\"></compose>\r\n        <!-- Request Details -->\r\n        <compose view=\"./requestDetails.html\"></compose>\r\n      </div>\r\n  </div>\r\n  \r\n  <compose view=\"./requestDetailDetails.html\"></compose>\r\n \r\n</div>\r\n\r\n    \r\n</template>"; });
define('text!modules/user/support/components/-time.html', ['module'], function(module) { module.exports = "<template>\r\n</template>"; });
define('text!modules/user/support/components/1-time.html', ['module'], function(module) { module.exports = "<template>\r\n\r\n    <div class=\"smart-timeline-icon bottomMarginLg\" innerhtml.bind=\"event.personId | gravatarUrlId:people.peopleArray:100:1\">\r\n\r\n    </div>\r\n    <div class=\"smart-timeline-time\">\r\n    <small>${event.createdDate | dateFormat:'YYYY-MM-DD':true}</small>\r\n    </div>\r\n    <div class=\"smart-timeline-content borderTop leftJustify\">\r\n    <div class=\"form-group\">\r\n        <p>${event.personId | personName:people.peopleArray}</p>\r\n        <label>Curriculum Title: ${event.content.curriculumTitle}</label>\r\n        <label class=\"col-sm-offset-1\">Exercise Module: ${event.content.exerciseModule}</label>\r\n        <label class=\"col-sm-offset-1\">Page: ${event.content.pageNumber}</label>\r\n        <label class=\"col-sm-offset-1\">User IDs: ${event.content.UserIDsaffected}</label>\r\n        <div class=\"form-group\">\r\n        <label if.bind=\"client.status==='01'\" class=\"col-md-6\">System: ${client.sid}</label>\r\n        <label if.bind=\"client.status==='01'\" class=\"col-md-6\">Client: ${client.sid}</label>\r\n        <label if.bind=\"client.status==='02'\" class=\"col-md-6\">Client not assigned</label>\r\n        <div class=\"topMargin\" if.bind=\"event.content.comments.length > 0\" innerhtml.bind=\"event.content.comments\"></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"form-group\">\r\n      <div class=\"hover_img\" repeat.for=\"file of event.files\">\r\n        <a href=\"${config.HELPTICKET_FILE_DOWNLOAD_URL}${helpTickets.selectedHelpTicket.helpTicketNo}/${file.fileName}\"\r\n           target=\"_blank\"\r\n           innerhtml.bind=\"file.fileName | fileType:helpTickets.selectedHelpTicket.helpTicketNo:'helpTickets'\"></a>\r\n      </div>\r\n    </div>\r\n\r\n    </div>\r\n</template>"; });
define('text!modules/user/support/components/2-time.html', ['module'], function(module) { module.exports = "<template>\r\n  <div class=\"smart-timeline-icon bottomMarginLg\" innerhtml.bind=\"event.personId | gravatarUrlId:people.peopleArray:100:1\">\r\n\r\n  </div>\r\n  <div class=\"smart-timeline-time\">\r\n    <small>${event.createdDate | dateFormat:'YYYY-MM-DD':true}</small>\r\n  </div>\r\n  <div class=\"smart-timeline-content borderTop leftJustify\">\r\n    <div class=\"form-group\">\r\n      <p>${event.personId | personName:people.peopleArray}</p>\r\n      <h4>User Ids: ${event.content.resetPasswordUserIDs}</h4>\r\n      <div class=\"form-group\">\r\n        <label if.bind=\"client.status==='01'\" class=\"col-md-6\">System: ${client.sid}</label>\r\n        <label if.bind=\"client.status==='01'\" class=\"col-md-6\">Client: ${client.sid}</label>\r\n        <label if.bind=\"client.status==='02'\" class=\"col-md-6\">Client not assigned</label>\r\n        <div class=\"topMargin\" if.bind=\"event.content.comments.length > 0\" innerhtml.bind=\"event.content.comments\"></div>\r\n      </div>\r\n      <div class=\"form-group\">\r\n        <div class=\"hover_img\" repeat.for=\"file of event.files\">\r\n          <a href=\"${config.HELPTICKET_FILE_DOWNLOAD_URL}${helpTickets.selectedHelpTicket.helpTicketNo}/${file.fileName}\"\r\n            target=\"_blank\"\r\n            innerhtml.bind=\"file.fileName | fileType:helpTickets.selectedHelpTicket.helpTicketNo:'helpTickets'\"></a>\r\n        </div>\r\n      </div>\r\n    </div>\r\n\r\n\r\n  </div>\r\n\r\n</template>\r\n"; });
define('text!modules/user/support/components/3-time.html', ['module'], function(module) { module.exports = "<template>\r\n  <div class=\"smart-timeline-icon bottomMarginLg\" innerhtml.bind=\"event.personId | gravatarUrlId:people.peopleArray:100:1\">\r\n\r\n  </div>\r\n  <div class=\"smart-timeline-time\">\r\n    <small>${event.createdDate | dateFormat:'YYYY-MM-DD':true}</small>\r\n  </div>\r\n  <div class=\"smart-timeline-content borderTop leftJustify\">\r\n    <div class=\"form-group\">\r\n      <p>${event.personId | personName:people.peopleArray}</p>\r\n      <h4>Application: ${event.content.applicationId | productName:apps.appDownloadsArray}</h4>\r\n      <div class=\"row\">\r\n        <div class=\"col-lg-4\" show.bind=\"event.content.osWindows || event.content.osMac\">\r\n          <h4>Operating System</h4>\r\n          <label show.bind=\"event.content.osWindows\">Windows versions: ${event.content.windowsVersion}</label>\r\n          <label show.bind=\"event.content.osWindows32bit\">32-bit</label>\r\n          <label show.bind=\"event.content.osWindows64bit\">64-bit</label>\r\n          <label show.bind=\"event.content.osMac\">Mac versions: ${event.content.macVersion}</label>\r\n        </div>\r\n        <div class=\"col-lg-4\" show.bind=\"event.content.officeInvolved\">\r\n          <h4>Microsoft Office</h4>\r\n          <label show.bind=\"event.content.officeVersion\">Office versions: ${event.content.officeVersion}</label>\r\n        </div>\r\n        <div class=\"col-lg-4\" show.bind=\"event.content.wiredNetwork || event.content.wirelessNetwork || event.content.campusNetwork || event.content.personalNetwork\">\r\n          <h4>Network</h4>\r\n          <label show.bind=\"event.content.wiredNetwork\">Wired</label>\r\n          <label show.bind=\"event.content.wirelessNetwork\">Wireless</label>\r\n          <label show.bind=\"event.content.campusNetwork\">Campus</label>\r\n          <label show.bind=\"event.content.personalNetwork\">Personal/Private Network</label>\r\n        </div>\r\n      </div>\r\n      <div class=\"row\">\r\n        <div class=\"topMargin\" if.bind=\"event.content.comments.length > 0\" innerhtml.bind=\"event.content.comments\"></div>\r\n      </div>\r\n    </div>\r\n    <div class=\"form-group\">\r\n      <div class=\"hover_img\" repeat.for=\"file of event.files\">\r\n        <a href=\"${config.HELPTICKET_FILE_DOWNLOAD_URL}${helpTickets.selectedHelpTicket.helpTicketNo}/${file.fileName}\"\r\n           target=\"_blank\"\r\n           innerhtml.bind=\"file.fileName | fileType:helpTickets.selectedHelpTicket.helpTicketNo:'helpTickets'\"></a>\r\n      </div>\r\n    </div>\r\n   \r\n  </div>\r\n</template>"; });
define('text!modules/user/support/components/4-time.html', ['module'], function(module) { module.exports = "<template>\r\n  <div class=\"smart-timeline-icon bottomMarginLg\" innerhtml.bind=\"event.personId | gravatarUrlId:people.peopleArray:100:1\">\r\n\r\n  </div>\r\n  <div class=\"smart-timeline-time\">\r\n    <small>${event.createdDate | dateFormat:'YYYY-MM-DD':true}</small>\r\n  </div>\r\n  <div class=\"smart-timeline-content borderTop leftJustify\">\r\n    <div class=\"form-group\">\r\n      <p>${event.personId | personName:people.peopleArray}</p>\r\n\r\n      <div if.bind=\"event.content.comments.length > 0\" innerhtml.bind=\"event.content.comments\"></div>\r\n    </div>\r\n    <div class=\"form-group\">\r\n      <div class=\"hover_img\" repeat.for=\"file of event.files\">\r\n        <a href=\"${config.HELPTICKET_FILE_DOWNLOAD_URL}${helpTickets.selectedHelpTicket.helpTicketNo}/${file.fileName}\"\r\n           target=\"_blank\"\r\n           innerhtml.bind=\"file.fileName | fileType:helpTickets.selectedHelpTicket.helpTicketNo:'helpTickets'\"></a>\r\n      </div>\r\n  </div>\r\n</template>\r\n"; });
define('text!modules/user/support/components/additiontalInfo.html', ['module'], function(module) { module.exports = "<template>\r\n    <div class=\"col-lg-12 topMargin\">\r\n        <!-- Help Panel -->\r\n        <compose  repeat.for=\"helpTicket of config.HELP_TICKET_TYPES\" \r\n            show.bind=\"helpTicket.show\"     \r\n            view=\"./help-ticket-${helpTicket.code}.html\"></compose>\r\n            \r\n        <!-- Additional Information Panel -->\r\n        <div show.bind=\"showAdditionalInfo\" class=\"col-md-12\" id=\"descriptionGroup\">\r\n            <div class=\"form-group\">\r\n            <label for=\"descriptionID\">Enter a description of the issue. Be as specific as possible and include steps that led up to the issue.</label>\r\n            <textarea id=\"descriptionID\" value.bind=\"helpTickets.selectedHelpTicketContent.content.comments\" class=\"form-control\" rows=\"12\"></textarea>\r\n            </div>\r\n\r\n            <div class=\"panel panel-default\">\r\n                <div class=\"input-group\">\r\n                    <span class=\"input-group-btn\">\r\n                        <span class=\"btn btn-primary btn-fill btn-wd btn-file\">\r\n                        Browse...<input change.delegate=\"changeFiles()\" id=\"uploadFiles\" files.bind=\"files\" type=\"file\" multiple=true>\r\n                        </span>\r\n                    </span>\r\n                    <input type=\"text\" value.bind=\"filesSelected\" class=\"form-control\" readonly/>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</template>"; });
define('text!modules/user/support/components/Courses.html', ['module'], function(module) { module.exports = "<template>\r\n    <div class=\"topMargin\">\r\n        <table id=\"coursesTable\" class=\"table table-striped table-hover\">\r\n            <thead>\r\n                <tr>\r\n                    <td colspan='6'>\r\n                        <span click.delegate=\"refreshCourses()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Refresh\"><i class=\"fa fa-refresh\" aria-hidden=\"true\"></i></span>\r\n                        <span click.delegate=\"newCourse()\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"New\"><i class=\"fa fa-plus\" aria-hidden=\"true\"></i></span>\r\n                        <span click.delegate=\"editACourse()\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Edit\"><i class=\"fa fa-pencil\" aria-hidden=\"true\"></i></span>\r\n                        <span class=\"pull-right\" id=\"spinner\" innerhtml.bind=\"spinnerHTML\"></span>\r\n                    </td>\r\n                </tr>\r\n                <tr>\r\n                    <th style=\"width:20rem;\">Number </th>\r\n                    <th style=\"width:30rem;\">Name</th>\r\n                </tr>\r\n            </thead>\r\n            <tbody>\r\n                <tr id=\"sandBoxRow\" click.delegate=\"selectCourse('a1a1a1a1a1a1a1a1a1a1a1a1')\">\r\n                    <td>${config.SANDBOX_NAME}</td>\r\n                    <td>${config.SANDBOX_NAME}</td>\r\n                </tr>\r\n                <tr id=\"selectCourse\" click.delegate=\"selectCourse($index, $event)\"  repeat.for=\"course of people.coursesArray\">\r\n                    <td data-title=\"number\">${course.number} </td>\r\n                    <td data-title=\"name\">${course.name}</td>\r\n                </tr>\r\n            </tbody>\r\n        </table>\r\n\r\n        <div class=\"row\" show.bind=\"courseSelected\">\r\n            <div class=\"panel panel-default col-md-12\">\r\n                <div class=\"panel-body\">\r\n                    <div class=\"form-group\">\r\n                        <input id=\"number\" value.bind=\"people.selectedCourse.number\" type=\"text\" placeholder=\"Course Number\"\r\n                            class=\"form-control\"/>\r\n                    </div>\r\n                    <div class=\"form-group\">\r\n                        <input id=\"name\" value.bind=\"people.selectedCourse.name\" type=\"text\" placeholder=\"Course Name\"\r\n                            class=\"form-control\"/>\r\n                    </div>\r\n                    <div class=\"row\">\r\n                        <div class=\"bottomMargin leftMargin rightMargin list-group-item\">\r\n                            <span click.delegate=\"saveCourse()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Save\"><i class=\"fa fa-floppy-o fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n                            <span click.delegate=\"cancelEditCourse()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Cancel\"><i class=\"fa fa-ban fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n                        </div> \r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</template>"; });
define('text!modules/user/support/components/help-ticket-1.html', ['module'], function(module) { module.exports = "<template>\r\n    <div class=\" col-md-12\" id=\"curriculumHelp\">\r\n    <div class=\"form-group\">\r\n      <!--        <label for=\"curriculumTitle\">Enter the curriculum title</label> -->\r\n      <input type=\"text\" value.bind=\"helpTickets.selectedHelpTicketContent.content.curriculumTitle\" class=\"form-control \"\r\n             id=\"curriculumTitle\" placeholder=\"Curriculum Title\">\r\n    </div>\r\n    <div class=\"form-group\">\r\n      <!--         <label for=\"ExerciseModule\">Enter the specfic module</label> -->\r\n      <input type=\"text\" value.bind=\"helpTickets.selectedHelpTicketContent.content.ExerciseModule\" class=\"form-control \"\r\n             id=\"ExerciseModule\" placeholder=\"Exercise/Module\">\r\n    </div>\r\n    <div class=\"form-group\">\r\n      <!--        <label for=\"PageNumber\">Enter the page number</label> -->\r\n      <input type=\"text\" value.bind=\"helpTickets.selectedHelpTicketContent.content.PageNumber\" class=\"form-control \"\r\n             id=\"PageNumber\" placeholder=\"Page Number\">\r\n    </div>\r\n    <div class=\"form-group\">\r\n      <!--        <label for=\"UserIDsaffected\">Enter the user IDs affected</label> -->\r\n      <input type=\"text\" value.bind=\"helpTickets.selectedHelpTicketContent.content.UserIDsaffected\" class=\"form-control \"\r\n             id=\"UserIDsaffected\" placeholder=\"User IDs affected\">\r\n    </div>\r\n  </div>\r\n</template>"; });
define('text!modules/user/support/components/help-ticket-2.html', ['module'], function(module) { module.exports = "<template>\r\n   <div class=\"col-lg-12\" id=\"resetPassword\">\r\n    <label for=\"resetPasswordUserIDs\">You can enter a range of user IDs or a list separated by commas.</label>\r\n    <input id=\"resetPasswordUserIDs\" value.bind=\"helpTickets.selectedHelpTicketContent.content.resetPasswordUserIDs\" type=\"text\" class=\"form-control\" placeholder=\"User IDs\">\r\n  </div>\r\n</template>"; });
define('text!modules/user/support/components/help-ticket-3.html', ['module'], function(module) { module.exports = "<template>\r\n  <div class=\" col-md-12\" id=\"appHelp\">\r\n      <div class=\"row\">\r\n        <div class=\"topMargin\">\r\n          <label class=\"control-label\">Application</label>\r\n          <select value.bind=\"helpTickets.selectedHelpTicketContent.content.applicationId\" id=\"application\" class=\"form-control\">\r\n            <option value=\"\">Select an application</option>\r\n            <option repeat.for=\"app of apps.appDownloadsArray\" \r\n                    value.bind=\"app._id\">${app.name}</option>\r\n          </select>\r\n        </div>\r\n      </div>\r\n      <div show.bind=\"helpTickets.selectedHelpTicketContent.content.applicationId\" class=\"row topMargin\">\r\n         <label class=\"control-label\">Describe the Operating System</label>\r\n         <div class=\"panel panel-default\">\r\n          <div class=\"panel-body\">\r\n            <div class=\"row\">\r\n              <div class=\"col-lg-6\">\r\n                <div class=\"checkbox\">\r\n                  <label>\r\n                    <input checked.bind=\"helpTickets.selectedHelpTicketContent.content.osWindows\" type=\"checkbox\"> Windows\r\n                  </label>\r\n                  <input show.bind=\"helpTickets.selectedHelpTicketContent.content.osWindows\" value.bind=\"helpTickets.selectedHelpTicketContent.content.windowsVersion\" id=\"editDropDate\" class=\"form-control\" placeholder=\"Windows 8, 8.1, 10, etc.\" type=\"text\" />\r\n                  <div class=\"row\"  show.bind=\"helpTickets.selectedHelpTicketContent.content.osWindows\">\r\n                    <div class=\"checkbox col-lg-6\">\r\n                      <label class=\"checkbox-inline\">\r\n                        <input checked.bind=\"helpTickets.selectedHelpTicketContent.content.osWindows32bit\" type=\"checkbox\"> 32-bit\r\n                      </label>\r\n                      <label class=\"checkbox-inline\">\r\n                        <input checked.bind=\"helpTickets.selectedHelpTicketContent.content.osWindows64bit\" type=\"checkbox\"> 64-bit\r\n                      </label>\r\n                    </div>\r\n                </div>\r\n                </div>\r\n              </div>  \r\n              <div class=\"col-lg-6\">\r\n                <div class=\"checkbox\">\r\n                  <label>\r\n                    <input checked.bind=\"helpTickets.selectedHelpTicketContent.content.osMac\" type=\"checkbox\"> Mac OS\r\n                  </label>\r\n                  <input  show.bind=\"helpTickets.selectedHelpTicketContent.content.osMac\" value.bind=\"helpTickets.selectedHelpTicketContent.content.macVersion\" id=\"editDropDate\" class=\"form-control\" placeholder=\"Mac OS Versions\" type=\"text\" />\r\n                </div>\r\n              </div>\r\n            </div>\r\n              \r\n            </div>\r\n          </div>\r\n        </div>\r\n        \r\n        <div class=\"row\">\r\n          <div show.bind=\"helpTickets.selectedHelpTicketContent.content.applicationId\" class=\"topMargin col-lg-6\">\r\n            <label class=\"control-label\">Other Software Involved</label>\r\n              <div class=\"panel panel-default\">\r\n                <div class=\"panel-body\">\r\n                  <div class=\"row\">\r\n                    <div class=\"col-lg-6\">\r\n                      <div class=\"checkbox\">\r\n                        <label>\r\n                          <input checked.bind=\"helpTickets.selectedHelpTicketContent.content.officeInvolved\" type=\"checkbox\"> Is Microsoft Office involved?\r\n                        </label>\r\n                        <input show.bind=\"helpTickets.selectedHelpTicketContent.content.officeInvolved\"  value.bind=\"helpTickets.selectedHelpTicketContent.content.officeVersion\" id=\"editJoinDate\" class=\"form-control\" placeholder=\"2007, 2010, 2013, etc.\" type=\"text\" />\r\n                      </div>\r\n                  </div>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        \r\n          <div show.bind=\"helpTickets.selectedHelpTicketContent.content.applicationId\" class=\"topMargin col-lg-6\">\r\n            <label class=\"control-label\">Describe the Network Connection</label>\r\n            <div class=\"panel panel-default\">\r\n              <div class=\"panel-body\">\r\n                <div class=\"row\">\r\n                    <div class=\"checkbox col-lg-12\">\r\n                      <label class=\"checkbox-inline\">\r\n                        <input checked.bind=\"helpTickets.selectedHelpTicketContent.content.wiredNetwork\" type=\"checkbox\"> Wired\r\n                      </label>\r\n                      <label class=\"checkbox-inline\">\r\n                        <input checked.bind=\"helpTickets.selectedHelpTicketContent.content.wirelessNetwork\" type=\"checkbox\"> Wireless\r\n                      </label>\r\n                    </div>\r\n                  </div>\r\n                  <div class=\"row\">  \r\n                    <div class=\"checkbox col-lg-12\">\r\n                      <label class=\"checkbox-inline\">\r\n                        <input checked.bind=\"helpTickets.selectedHelpTicketContent.content.campusNetwork\" type=\"checkbox\"> Campus\r\n                      </label>\r\n                      <label class=\"checkbox-inline\">\r\n                        <input checked.bind=\"helpTickets.selectedHelpTicketContent.content.personalNetwork\" type=\"checkbox\"> Personal/Private Network\r\n                      </label>\r\n                    </div>\r\n                  </div>\r\n                </div>\r\n                  \r\n              </div>\r\n            </div>\r\n        </div>\r\n      \r\n  </div>\r\n</template>"; });
define('text!modules/user/support/components/help-ticket-4.html', ['module'], function(module) { module.exports = "<template>\r\n\r\n</template>"; });
define('text!modules/user/support/components/helpTicketDetails.html', ['module'], function(module) { module.exports = "<template>\r\n\r\n    <div class=\"bottomMargin list-group-item leftMargin rightMargin\">\r\n        <span click.delegate=\"save()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Save Response\"><i class=\"fa fa-floppy-o fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n        <span click.delegate=\"cancel()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Cancel\"><i class=\"fa fa-ban fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n    </div> \r\n    \r\n     <div class=\"col-lg-12 topMargin\">\r\n        <!-- Help Panel -->\r\n        <compose  repeat.for=\"helpTicket of config.HELP_TICKET_TYPES\" \r\n            show.bind=\"helpTicket.show\"     \r\n            view=\"./help-ticket-${helpTicket.code}.html\"></compose>\r\n            \r\n        <!-- Additional Information Panel -->\r\n        <div class=\"col-lg-12 topMargin\" id=\"descriptionGroup\">\r\n            <div class=\"form-group\">\r\n            <label for=\"descriptionID\">Enter a description of the issue. Be as specific as possible and include steps that led up to the issue.</label>\r\n            <textarea id=\"descriptionID\" value.bind=\"helpTickets.selectedHelpTicketContent.content.comments\" class=\"form-control\" rows=\"12\"></textarea>\r\n            </div>\r\n\r\n            <div class=\"panel panel-default\">\r\n                <div class=\"input-group\">\r\n                    <span class=\"input-group-btn\">\r\n                        <span class=\"btn btn-primary btn-fill btn-wd btn-file\">\r\n                        Browse...<input change.delegate=\"changeFiles()\" id=\"uploadFiles\" files.bind=\"files\" type=\"file\" multiple=true>\r\n                        </span>\r\n                    </span>\r\n                    <input type=\"text\" value.bind=\"filesSelected\" class=\"form-control\" readonly/>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</template>"; });
define('text!modules/user/support/components/helpTicketType.html', ['module'], function(module) { module.exports = "<template>\r\n     <div class=\"form-group topMargin\">\r\n        <select value.bind=\"helpTickets.selectedHelpTicket.sessionId\" change.delegate=\"sessionChanged($event)\" id=\"session\" class=\"form-control\">\r\n          <option value=\"\">Select a session</option>\r\n          <option repeat.for=\"session of sessions.sessionsArray\"\r\n                  value.bind=\"session._id\">Session ${session.session} - ${session.year}</option>\r\n        </select>\r\n      </div>\r\n\r\n      <!-- Type Select -->\r\n      <div show.bind=\"helpTickets.selectedHelpTicket.sessionId !== ''\" class=\"form-group\">\r\n        <select value.bind=\"helpTickets.selectedHelpTicket.helpTicketType\" change.delegate=\"typeChanged($event)\"\r\n                id=\"helpTicketPurpose\" class=\"form-control\">\r\n          <option value=\"-1\">Select the type of help ticket</option>\r\n          <option repeat.for=\"types of config.HELP_TICKET_TYPES\"\r\n                  value.bind=\"types.code\">${types.description}</option>\r\n        </select>\r\n      </div>\r\n\r\n      <div show.bind=\"config.HELP_TICKET_TYPES[helpTickets.selectedHelpTicket.helpTicketType - 1].message !== undefined\">\r\n        <div  class=\"well well-sm\" innerhtml.bind=\"config.HELP_TICKET_TYPES[helpTickets.selectedHelpTicket.helpTicketType - 1].message\" ></div>\r\n      </div>\r\n</template>"; });
define('text!modules/user/support/components/Requests.html', ['module'], function(module) { module.exports = "<template>\r\n      <div >\r\n        <table id=\"clientTable\" class=\"table table-bordered table-responsive\" style=\"background:white;\">\r\n          <thead>\r\n          <tr class=\"header\">\r\n            <th>Product</th>\r\n            <th>System</th>\r\n            <th>Client</th>\r\n            <th>Status</th>\r\n          </tr>\r\n          </thead>\r\n          <tbody>\r\n            <tr id=\"${product.id}\" productId=\"${product.productId}\" \r\n                repeat.for=\"product of clientRequestsArray\"\r\n                click.trigger=\"requestChosen($event, product)\">\r\n              <td>${product.productId | productName:products.productsArray}</td>\r\n              <td>${product.systemId | lookupSid:systems.systemsArray}</td>\r\n              <td>${product.client}</td>\r\n              <td>${product.requestStatus | lookupDescription:config.REQUEST_STATUS}</td>\r\n            </tr>\r\n          </tbody>\r\n        </table>\r\n        <span id=\"client\"></span>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</template>"; });
define('text!modules/user/support/components/selectProduct.html', ['module'], function(module) { module.exports = "<template>\r\n     <compose view='./Courses.html' show.bind=\"config.HELP_TICKET_TYPES[helpTickets.selectedHelpTicket.helpTicketType - 1].clientRequired\"></compose>\r\n\r\n      <!-- Product Select -->\r\n      <div show.bind=\"helpTickets.selectedHelpTicket.courseId !== '' && clientRequestsArray.length > 0\">\r\n        <table id=\"clientTable\" class=\"table table-bordered table-responsive\" style=\"background:white;\">\r\n          <thead>\r\n          <tr class=\"header\">\r\n            <th>Product</th>\r\n            <th>System</th>\r\n            <th>Client Number</th>\r\n            <th>Status</th>\r\n          </tr>\r\n          </thead>\r\n          <tbody>\r\n          <tr id=\"${product.id}\" productId=\"${product.productId}\" \r\n              repeat.for=\"product of clientRequestsArray[0].requestDetails\">\r\n            <td >${product.productId}</td>\r\n            <td>${product.sid | lookupSid:systems}</td>\r\n            <td>${product.client}</td>\r\n            <td>${product.status | lookupDescription:config.REQUEST_STATUS}</td>\r\n          </tr>\r\n          </tbody>\r\n        </table>\r\n        <span id=\"client\"></span>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</template>"; });
define('text!modules/user/support/components/viewHTForm.html', ['module'], function(module) { module.exports = "<template>\r\n    <div class=\"col-lg-12\">\r\n\r\n    <!-- Buttons -->\r\n     <div class=\"bottomMargin list-group-item\">\r\n        <span click.delegate=\"back()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Back\"><i class=\"fa fa-arrow-left fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n        <span click.delegate=\"respond()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Respond\"><i class=\"fa fa-paper-plane fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n        <span>Click here to respond</span>\r\n    </div>  \r\n\r\n    <!-- Help Ticket Header -->\r\n    <div class=\"topMargin\">\r\n        <!-- Enter Response -->\r\n        <div show.bind=\"enterResponse\" class=\"topMargin bottomMargin\">\r\n\r\n          <div class=\"bottomMargin list-group-item leftMargin rightMargin\">\r\n            <span click.delegate=\"saveResponse()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Save Response\"><i class=\"fa fa-floppy-o fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n            <span click.delegate=\"cancelResponse()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Cancel\"><i class=\"fa fa-ban fa-lg fa-border\" aria-hidden=\"true\"></i></span>\r\n          </div> \r\n\r\n          <div class=\"col-md-12 topMargin\">\r\n            <textarea value.bind=\"helpTickets.selectedHelpTicketContent.content.comments\" class=\"form-control\" rows=\"10\"></textarea>\r\n          </div>\r\n\r\n          <div class=\"topMargin\">\r\n            <div class=\"input-group\">\r\n              <span class=\"input-group-btn\">\r\n                <span class=\"btn btn-primary btn-file topMargin bottomMargin\">\r\n                  Browse...<input change.delegate=\"changeFiles()\" id=\"uploadFiles\" files.bind=\"files\" type=\"file\" multiple=true>\r\n                </span>\r\n              </span>\r\n              <input type=\"text\" value.bind=\"filesSelected\" class=\"form-control topMargin bottomMargin\" readonly/>\r\n            </div>\r\n          </div>\r\n\r\n        </div>\r\n\r\n        <!-- widget content -->\r\n        <div class=\"row\">\r\n        <div class=\"panel panel-default col-md-12\">\r\n\r\n          <div class=\"panel-body\">\r\n            <div class=\"row\">\r\n              <div class=\"col-md-6\">\r\n                <div class=\"form-group\">\r\n                  <h3 class=\"col-md-offset-1\">Created: ${helpTickets.selectedHelpTicket.createdDate | dateFormat:'YYYY-MM-DD'} ${helpTickets.selectedHelpTicket.createdDate | dateFormat:'h:mm A'}</h3>\r\n                </div>\r\n              </div>\r\n              <div class=\"col-md-6\">\r\n                <div class=\"form-group col-md-10\">\r\n                  <h3>Type: ${helpTickets.selectedHelpTicket.helpTicketType | lookupDescription:config.HELP_TICKET_TYPES}</h3>\r\n                </div>\r\n              </div>\r\n            </div>\r\n            <div class=\"row\">\r\n              <div class=\"col-md-6\">\r\n                <div class=\"form-group\">\r\n                  <h3 class=\"col-md-offset-1\">Session: ${helpTickets.selectedHelpTicket.sessionId | session:sessions.sessionsArray}</h3>\r\n                </div>\r\n              </div>\r\n              <div class=\"col-md-6\">\r\n              <div class=\"form-group col-md-10\">\r\n                <h3>Status: ${helpTickets.selectedHelpTicket.helpTicketStatus | lookupDescription:config.HELP_TICKET_STATUSES}</h3>\r\n              </div>\r\n              </div>\r\n            </div>\r\n            <div class=\"row\">\r\n              <div class=\"col-md-6\">\r\n                <div class=\"form-group\">\r\n                  <label class=\"col-md-offset-1\">Owner: ${helpTickets.selectedHelpTicket.owner[0].personId |  person:people.peopleArray:'fullName'}</label>\r\n                </div>\r\n              </div>\r\n              <div class=\"col-md-6\">\r\n                <div class=\"form-group col-md-10\">\r\n                  <label>Keywords: ${helpTickets.selectedHelpTicket.keyWords}</label>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n    </div>\r\n    <div class=\"well well-sm topMargin\">\r\n      <!-- Timeline Content -->\r\n      <div class=\"smart-timeline\">\r\n        <ul class=\"smart-timeline-list\">\r\n          <li  repeat.for=\"event of helpTickets.selectedHelpTicket.content | sortDateTime:'createdDate':'DESC':isUCC\">\r\n            <compose view=\"./${event.type}-time.html\"></compose>\r\n          </li>\r\n        </ul>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</template>\r\n"; });
define('text!modules/user/support/components/viewHTTable.html', ['module'], function(module) { module.exports = "<template>\r\n    <div class=\"col-lg-12 col-sm-12\">\r\n        <div class='row'>\r\n            <div class='col-lg-10 col-lg-offset-1 bottomMargin'>\r\n                <table id=\"helpTicketTable\" class=\"table table-striped table-hover\">\r\n                    <thead>\r\n                        <tr>\r\n                            <td colspan='6'>\r\n                                <compose view=\"../../../../resources/elements/table-navigation-bar.html\"></compose>\r\n                            </td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td colspan='6'>\r\n                                <span click.delegate=\"refresh()\" class=\"smallMarginRight\"  bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Refresh\"><i class=\"fa fa-refresh\" aria-hidden=\"true\"></i></span>\r\n                                <span class=\"pull-right\" id=\"spinner\" innerhtml.bind=\"spinnerHTML\"></span>\r\n                            </td>\r\n                        </tr>\r\n                  <tr>\r\n                    <th></th>\r\n                    <th class=\"hasinput\">\r\n                      <select change.delegate=\"dataTable.filterList($event)\" class=\"form-control\" id=\"helpTicketType\">\r\n                        <option value=\"\"></option>\r\n                        <option repeat.for=\"type of config.HELP_TICKET_TYPES\"\r\n                                value.bind=\"type.code\">${type.description}</option>\r\n                      </select>\r\n                    </th>\r\n                    <th class=\"hasinput\">\r\n                      <select value.bind=\"selectedStatus\" change.delegate=\"dataTable.filterList($event)\" class=\"form-control\" id=\"helpTicketStatus\">\r\n                        <option value=\"\"></option>\r\n                        <option repeat.for=\"status of config.HELP_TICKET_STATUSES\"\r\n                                value.bind=\"status.code\">${status.description}</option>\r\n                      </select>\r\n                    </th>\r\n                    <th class=\"hasinput\">\r\n                      <input change.delegate=\"dataTable.filterList($event)\" id=\"createdDate\" type=\"date\" placeholder=\"Filter Date\" class=\"form-control datepicker\" data-dateformat=\"yy/mm/dd\">\r\n                    </th>\r\n                  </tr>\r\n                  <tr>\r\n                    <th>\r\n                      Number <span click.trigger=\"dataTable.sortArray('helpTicketNo')\"><i class=\"fa fa-sort\"></i></span>\r\n                    </th>\r\n                    <th>\r\n                      Type <span click.trigger=\"dataTable.sortArray('helpTicketType')\"><i class=\"fa fa-sort\"></i></span><br>\r\n                    </th>\r\n                    <th>\r\n                      Status <span click.trigger=\"dataTable.sortArray('status')\"><i class=\"fa fa-sort\"></i></span><br>\r\n                    </th>\r\n                    <th>\r\n                      Date Created <span click.trigger=\"dataTable.sortArray('dateCreated')\"><i class=\"fa fa-sort\"></i></span>\r\n                    </th>\r\n                  </tr>\r\n                  </thead>\r\n                  <tbody>\r\n                  <tr repeat.for=\"helpTicket of displayArray  | pageFilter:dataTable.startRecord:dataTable.take\" click.delegate=\"selectHelpTicket($event, $index)\">\r\n                    <td data-title=\"referenceNo\">${helpTicket.helpTicketNo}</td>\r\n                    <td data-title=\"type\">${helpTicket.helpTicketType | lookupDescription:config.HELP_TICKET_TYPES}</td>\r\n                    <td data-title=\"status\">${helpTicket.helpTicketStatus | lookupDescription:config.HELP_TICKET_STATUSES}</td>\r\n                    <td data-title=\"createdDate\">${helpTicket.createdDate | dateFormat:config.DATE_FORMAT_TABLE:true}</td>\r\n                  </tr>\r\n                  </tbody>\r\n                </table>\r\n            </div>\r\n            <div class=\"row\" show.bind=\"helpTicketSelected\">\r\n              <compose view=\"./viewHTForm.html\"></compose>\r\n            </div>\r\n          </div>\r\n      </div>\r\n    </div>\r\n</template>"; });
